INSERT INTO `alpha_coins_shop` VALUES (1,10,'<div class=\"row\"> <div class=\"col-md-3\"> <a href=\"#\" onclick=\"$(\'#demo-0\')[0].play();return false;\" ><img src=\"http://secretrepublic.net/layout/img/characters/eve.png\" style=\"max-width:100%\"/> </a></div> <div class=\"col-md-9\">Your <strong>personal Artificial Intelligent assistant</strong> will greet you when you connect and will notify you as certain events take place. For example: in missions (commands and actions), jobs, training, general notices (errors and warnings), login, 404 pages, etc. <br/><br/>You will have the ability to activate/deactivate the voice using the Settings interface (same one you can change your password in). <br/><br/>Verify if your can hear the following demo: <div class=\"text-center\"><br/><br/> <div class=\"row\">   <div class=\"col-md-4\">     <a href=\"#\" onclick=\"$(\'#demo-0\')[0].play();return false;\" class=\"button text-center mb10\">HELLO</a>   </div><div class=\"col-md-4\">     <a href=\"#\" onclick=\"$(\'#demo-1\')[0].play();return false;\" class=\"button text-center mb10\">INITIATED</a>   </div>   <div class=\"col-md-4\">     <a href=\"#\" onclick=\"$(\'#demo-2\')[0].play(); return false;\" class=\"button text-center mb10\">PING</a>   </div> </div> <audio controls class=\"nodisplay\" id=\"demo-0\">   <source src=\"http://secretrepublic.net/mp3/eve/ogg/ai_intro.ogg\" type=\"audio/ogg\">   <source src=\"http://secretrepublic.net/mp3/eve/ai_intro.mp3\" type=\"audio/mpeg\"> Your browser does not support the audio element. </audio>\n<audio controls class=\"nodisplay\" id=\"demo-1\">   <source src=\"http://secretrepublic.net/mp3/eve/ogg/systems_initiated_welcome.ogg\" type=\"audio/ogg\">   <source src=\"http://secretrepublic.net/mp3/eve/systems_initiated_welcome.mp3\" type=\"audio/mpeg\"> Your browser does not support the audio element. </audio>\n<br/><br/> <audio controls class=\"nodisplay\" id=\"demo-2\">   <source src=\"http://secretrepublic.net/mp3/eve/ogg/ping_in_progress.ogg\" type=\"audio/ogg\">   <source src=\"http://secretrepublic.net/mp3/eve/ping_in_progress.mp3\" type=\"audio/mpeg\"> Your browser does not support the audio element. </audio> </div></div></div>','ai','Personal Assistant - A.I. Voice - Welcome, Commands, Notifications',1,1,1,''),(3,10,'An onscreen notepad will allow you to take notes, copy objectives and email contents and virtually write anything you might find useful for completing the mission at hand.','missionNotepad','Notepad in missions',998,1,1,''),(4,10,'<p>The floating party chat box will be available everywhere and not only when in mission or on the party page.\r\n</p>\r\n<p>\r\nEven more, it\'s enough for one party member to have this feature active for everyone in the party to enjoy it.</p>\r\nFun never comes alone.','partyChat','Party Chat outside of Missions and Party interface',7,1,1,''),(5,10,'Obtain access to the Attack Simulator. You can input any skill values for imaginary attackers and defenders plus their servers and simulate the outcome to better predict your success rates. ','attackSimulator','Grid Attacks Simulator',6,1,1,''),(6,10,'Remove any and all in-game ads prompting you to obtain Alpha Coins or otherwise (e.g. notices from storage page, mission console, main overview).','removeAds','Remove all Ads (Get Alpha Coins and Extra options notifications)',4,1,1,''),(7,10,'You will be able to modify the hostname of each of the servers you own. Hostnames appear wherever servers are concerned, for example in missions and Grid attacks.','serversHostname','Change Servers Hostname',999,1,1,''),(8,10,'A full history of the commands used (and executed succesfully) followed by their full output will be made available to your.<br/><br/>In case of party missions you will gain the ability to view the history of every other participant as well (from a selectable menu).<br/><br/>Never forget the details again and avoid the annoying scrolling through the console by using the history interface.','consoleHistory','Console History in Solo and Party Missions',5,1,1,''),(9,10,'Add 10 slots to your storage limit, on top of the default and level slots. Once this service expires if you have items over the limit in storage they will remain there but you will be unable to add more items until you free up some space just how you would normally have to do in case you reach your storage limit.','extraStorage1','10 Extra Storage Slots',4,1,1,''),(10,10,'<p>Finding hard to complete some of the more difficult missions or simply want to focus more on the story, fun and learning process rather than keepin\' an eye on the unforgivable timer running out before your very eyes?</p>\n<p>This Time Bubble device has been developed by Alpha in secret and is available to very few people for testing purposes. Taking advantage of Quantum Entanglement theories that support time travel aspirations, it changes the way you perceive time will remain the same, however you will have 25% more time to finish any mission. If you\'re in a party everyone else will benefit of the extra time as well.</p>\n<p><strong>Instructions</strong></p>\n<p>You will be able to use the device <strong>once per day</strong> (if you use it on Monday, regardless of the hour, you will be able to use it again on Tuesday based on Alpha server time).</p>\n<p>To start the device and add 25% time write the following in the console:</p>\n<strong>time delusion</strong>','extraTime','Time Distortion Device ~ +25% time in missions',3,1,1,''),(11,10,'The expert send by Alpha will perform regular audits and improve they way you mine behind the scenes. He promises and delivers an increase of 15% in your Data Points mining.','extraDataPoints15','Mining Consultant ~ +15% more Data Points',3,1,1,''),(12,200,'<h4>Want your own chance to stand in the spotlight?</h4>\n<p>Become an Intern for Alpha Corporation and receive access to an (as easy as it can be) mission design interface used by their experts to design the competition missions.</p>\n<p>You will be given total freedom of choice to create your Mission Group and Missions the way you want them. It\'s your story, your missions. You\'ll be able to add as many servers as you want and plan and implement your objectives and side-objectives.</p>\n<p>Alpha employees will give you a hand along the way and help you refine everything when you think you\'re ready to publish one or more missions. Once Alpha approves your missions contents, they will be available for the entire world of the Secret Republic to enjoy, with credits given to none other than yourself!</p>\n<p>If you so desire, Alpha will consider creating special achievements for your missions and even for hidden side-objectives in them. You\'ll be able to also propose the rewards given upon completion and suggest Daily and Party missions not just normals.</p>\n<h4>You\'ll finally be able to tell other you\'re not just a hacker but one who creates for other hackers</h4>','questManager','Mission Design Engineer Intern',2,1,1,''),(13,10,'Double your current hourly energy recovery rate to increase efficiency and get the chance to do more in less time without having to wait as long to recover.','recoveryRateDouble','Double your Energy Hourly Recovery Rate',4,1,1,''),(14,5,'<p>Be able to create 5 notes instead of just one and of 50 000 characters in length instead of just 500.</p>Once this service expires if you have more than one note they will remain and you will be able to updated them but you will no longer be able to c...','notes','Notes upgrade',5,1,1,''),(15,10,'Increase your bank vault storage amount. You\'ll be able to completely secure more money. This option stacks with other limit increasing options and when expired the money will remain in vault until redeemed.','bankLimit1','Bank Limit (+10,000$)',8,1,1,''),(16,20,'Increase your bank vault storage amount. You\'ll be able to completely secure more money. This option stacks with other limit increasing options and when expired the money will remain in vault until redeemed.','bankLimit2','Bank Limit (+30,000$)',8,1,1,''),(17,20,'The Bad Apples mission group will become accessible to you. There\'s at least one daily mission available amongst the missions of this group and more normal (one time) missions are added to it constantly. This Mission pack is challenging, fun and rewarding and will test most aspects of your knowledge earned so far as a hacker.<br/><br/>\nMissions have been carefully designed to make it worth your while ^^.\n<br/><Br/>\nIn this mission pack we also try to give you more freedom in choosing what paths to follow inside a mission, giving you alternative ways of reaching the ending.\n<br/></br>\n<strong><em>Premise: I\'ve done enough for everybody else. I think this is the perfect moment I start doing things for myself.</em></strong>','missionsPack1','Mission Pack I (More Missions)',1,1,1,''),(18,10,'<p>Many missions require you to decode and sometimes even encode strings from and to base64. You can of course do that by using external tools you can find on the still available world wide web.</p>\n<p>But we believe in ease of access and so these commands will allow you to complete these tasks directly in the console using simple commands like <strong>base64 encode stringHere</strong> and <strong>base64 decode stringHere</strong>.</p>\nEasy peasy.','base64','Base64 Encoding/Decoding Console Command',4,1,1,''),(19,10,'<p>This slight limitation can become an obstacle on the path of your destiny.</p>Increase the number of simultanious tasks you can execute to 6 and improve your chances for greatness.','maxTasks1','Increase Max Tasks Limit to 6',2,1,1,''),(20,20,'<p>This slight limitation can become an obstacle on the path of your destiny.</p>Increase the number of simultanious tasks you can execute to 10 and improve your chances for greatness.','maxTasks2','Increase Max Tasks Limit to 10',2,1,1,''),(21,250,'<p>Add 1 month to all currently available features (to those you have already activated, if any, as well).</p>\n\nAll services will be activated automatically for an extra month as soon as this option is bought.','oneMonthAll','UBER Activation - One month to ALL services (worth > 400A-C)',0,2,1,'2592000'),(22,10,'A notification will be displayed next to the delivery date of every message you send letting you know if the receiver has seen the message or not.\r\n\r\n','seenConv','Seen/Unseen for Conversations',0,1,0,'');
/*!40000 ALTER TABLE `alpha_coins_shop` ENABLE KEYS */;
UNLOCK TABLES;

