INSERT INTO `email_templates` VALUES ('Alpha Coins Delivered','<p>Hello,</p>\r\n\r\n<p>We\'ve processed and delivered ALPHA_COINS Alpha Coins to your account.</p>\r\n<p>If you have any questions or problems please contact our team using the contact form.</p>\r\n<p>Enjoy the premium features and hack away!</p>','alpha_coins','Alpha Coins'),('Secret Republic - Email Confirmation','<p>Hello USERNAME,</p>\r\n<p>\r\nPlease access the following link to confirm your email address. You can do so by clicking it or copy-pasting into your browser\'s navigation bar.</p>\r\n<p>\r\n<strong>Confirmation link</strong><br/>\r\nCONFIRMATION_URL</p>\r\n\r\n','email_confirmation','Email confirmation'),('Secret Republic - Account details retrieval','<p>Dear USERNAME,</p>\r\n<p>\r\nA request for username and password recovery has been received for your account. If you believe this is a mistake please ignore this email.\r\n</p>\r\n<p>\r\nTo reset your password please access the following link. You can do so either by clicking it or copy-pasting into your browser\'s navigation bar.\r\n</p>\r\n<p>\r\n<strong>\r\nPassword reset link: RESET_URL\r\n</strong></p>\r\n<p>\r\nThis link will be valid for the next 48 hours.\r\n</p>\r\n','forgot_password','Forgot password'),('Secret Republic - Your hacker account','<p>Hello USERNAME,</p>\r\n\r\n<p>We\'ve been keen on meeting you for quite a while now. Welcome to the Secret Republic, the world of hackers.</p>\r\n\r\n<p>The Secret Republic has been, currently is and will be under active development with new things popping up all the time thanks to your feedback and suggestions.</p>\r\n\r\n<p>Use the contact option at the bottom of the site to give us feedback and report problems.</p>\r\n\r\n<p>\r\n<strong>Secret Republic is free to play. However, as you\'d expect, there are ways to improve gameplay above and beyond by getting <em>Alpha Coins</em> and opting for extra features.</strong></p>\r\n<p>\r\nThe Mission Notepad, Attack Simulator, Ad removal, Console History and Artificial Intelligence Entity voice extras will be automatically added to your account for your first few days.</p>\r\n\r\n<p>\r\nWe will be keeping a close eye on you, USERNAME.\r\n</p>\r\n\r\n<p>\r\nIs it good to be strong? Is it bad to be weak? You now have the weapons you need to engineer your destiny.</p>\r\n<br/>\r\n\r\nHacking means knowledge and knowledge means power. And great power no longer means great responsibilities.\r\n','welcome','Welcome email');
/*!40000 ALTER TABLE `email_templates` ENABLE KEYS */;
UNLOCK TABLES;

