d called what\'s-the-earliest- date-by-which-you-can\'t-prove-you-won\'t-be- finished ','Tom DeMarco',1395571892,1,'hackersays.com'),(295,1559,'Question: How does a large software project get to be one year late? Answer: One day at a time!','Fred Brooks',1395571892,1,'hackersays.com'),(296,1559,'The question of whether computers can think is just like the question of whether submarines can swim.','Edsger W. Dijkstra',1395571892,1,'hackersays.com'),(297,1559,'Java is C++ without the guns, knives, and clubs.','James Gosling',1395571892,1,'hackersays.com'),(298,1559,'Real Programmers don\'t comment their code. If it was hard to write, it should be hard to understand.','Anonymous',1395571892,1,'hackersays.com'),(299,1559,'All problems in computer science can be solved with another level of indirection.','David Wheeler',1395571892,1,'hackersays.com'),(300,1559,'Engineering is the art of doing with one dollar what any damn fool can do with two.','From Space Systems Failures by David M. Harland an',1395571892,1,'hackersays.com'),(301,1559,'Bringing computers into the home won\'t change either one, but may revitalize the corner saloon.','Alan J. Perlis',1395571892,1,'hackersays.com'),(302,1559,'It&rsquo;s hard to read through a book on the principles of magic without glancing at the cover periodically to make sure it isn&rsquo;t a book on software design.','Bruce Tognazzini',1395571892,1,'hackersays.com'),(303,1559,'When we write programs that &quot;learn&quot;, it turns out that we do and they don\'t.&lt;br&gt;','Alan J. Perlis',1395571893,1,'hackersays.com'),(304,1559,'The function of good software is to make the complex appear to be simple.','Grady Booch',1395571893,1,'hackersays.com'),(305,1559,'If you want to confuse your enemies, give them the source code. If you want to really confuse them, give them the documentation.','Anonymous',1395571893,1,'hackersays.com'),(306,1559,'I\'m not a great programmer; I\'m just a good programmer with great habits.','Kent Beck',139557