ood servants but are poor masters.','Mark Dowd, John McDonald & Justin Schuh',1395571895,1,'hackersays.com'),(337,1559,'Though a program be but three lines long, someday it will have to be maintained.','Tao Of Programming',1395571896,1,'hackersays.com'),(338,1559,'If you require information, do not free memory containing the information.','MSDN',1395571896,1,'hackersays.com'),(339,1559,'When a professional race car driver races, his pulse gets lower and he relaxes. &lt;br&gt;When I code it is the same thing.&lt;br&gt;','Jun-ichiro Hagino',1395571896,1,'hackersays.com'),(340,1559,'What you&rsquo;ve described, &ldquo;The bottleneck in writing code isn&rsquo;t in the writing of the code, it&rsquo;s in understanding and conceptualising what needs to be done,&rdquo; is common to all highly abstract programming languages. Writing Haskell, for example, involves an hour of meditatio','Jonathan Feinberg',1395571896,1,'hackersays.com'),(341,1559,'The use of COBOL cripples the mind; its teaching should, therefore, be regarded as a criminal offence.','Edsger Dijkstra',1395571896,1,'hackersays.com'),(342,1559,'I think Microsoft named .Net so it wouldn\'t show up in a Unix directory listing.','Oktal',1395571896,1,'hackersays.com'),(343,1559,'Before software should be reusable, it should be usable.','Ralph Johnson',1395571896,1,'hackersays.com'),(344,1559,'No one hates software more than software developers.','Jeff Atwood',1395571896,1,'hackersays.com'),(345,1559,'Mostly, when you see programmers, they aren\'t doing anything. One of the attractive things about programmers is that you cannot tell whether or not they are working simply by looking at them. Very often they\'re sitting there seemingly drinking coffee and gossiping, or just staring into space. What t','Charles M Strauss',1395571896,1,'hackersays.com'),(346,1559,'Change breaks the brittle.','Jan Houtema',1395571896,1,'hackersays.com'),(347,1559,'In the long run every program becomes rococo - then rubble.','Alan J. Perlis',1395571896,1,'hackersays.com'),(348,1559,'C trades a slap on the wrist at compile time for a knife in the back at run time.','Anonymous',1395571896,1,'hackersays.com'),(349,1559,'In order to understand recursion, one must first understand recursion.','Anonymous',1395571897,1,'hackersays.com'),(350,1559,'Any fool can use a computer. Many do.','Ted Nelson',1395571897,1,'hackersays.com'),(351,1559,'With regard to adding more programmers to get a project done faster - Nine people can\'t make a baby in a month.','Fred Brooks',1395571897,1,'hackersays.com'),(352,1559,'It takes an intelligent person to build something complex; it takes a genius to build something simple.','Anonymous',1395571897,1,'hackersays.com'),(353,1559,'Some people, when confronted with a problem, think &quot;I know, I\'ll use regular expressions.&quot; Now they have two problems.','Jamie Zawinski',1395571897,1,'hackersays.com'),(354,1559,'I think there\'s a world market for about five computers.','Thomas J Watson Senior, 1945',1395571897,1,'hackersays.com'),(355,1559,'It\'s difficult to extract sense from strings, but they\'re the only communication coin we can count on.','Alan J. Perlis',1395571897,1,'hackersays.com'),(356,1559,'I don\'t care if it works on your machine! We are not shipping your machine!','Ovidiu Platon',1395571897,1,'hackersays.com'),(357,1559,'In programming, everything we do is a special case of something more general -- and often we know it too quickly.','Alan J. Perlis',1395571897,1,'hackersays.com'),(358,1559,'Weeks of coding can save you hours of planning.','Anonymous',1395571897,1,'hackersays.com'),(359,1559,'Though the Chinese should adore APL, it\'s FORTRAN they put their money on.','Alan J. Perlis',1395571897,1,'hackersays.com'),(360,1559,'A fool with a tool is still a fool.','Anonymous',1395571897,1,'hackersays.com'),(361,1559,'Program testing can be a very effective way to show the presence of bugs, but is hopelessly inadequate for showing their absence.','Edsger Dijkstra',1395571898,1,'hackersays.com'),(362,1559,'I have found that the reason a lot of people are interested in artificial intelligence is the same reason a lot of people are interested in artificial limbs: they are missing one.','David Parnas',1395571898,1,'hackersays.com'),(363,1559,'Every program has (at least) two purposes: the one for which it was written, and another for which it wasn\'t.','Alan J. Perlis',1395571898,1,'hackersays.com'),(364,1559,'If you don\'t think you\'re doing great things, you\'re probably right.','Anonymous',1395571898,1,'hackersays.com'),(365,1559,'In essence, let the market design the product.','Paul Graham',1395571899,1,'hackersays.com'),(366,1559,'The competent programmer is fully aware of the limited size of his own skull. He therefore approaches his task with full humility, and avoids clever tricks like the plague.','Edsger Dijkstra',1395571899,1,'hackersays.com'),(367,1559,'Theory is when you know something, but it doesn\'t work. Practice is when something works, but you don\'t know why. Programmers combine theory and practice: Nothing works and they don\'t know why.','Anonymous',1395571899,1,'hackersays.com'),(368,1559,'Interfaces keep things tidy, but don\'t accelerate growth: Functions do.','Alan J. Perlis',1395571899,1,'hackersays.com'),(369,1559,'Good programmers know what to write. Great ones know what to rewrite (and reuse).','Eric Raymond',1395571899,1,'hackersays.com'),(370,1559,'Jesus saves but only Buddha makes incremental backups.','Anonymous',1395571899,1,'hackersays.com'),(371,1559,'Like a gas, software expands to fill its containing memory completely.','Anonymous',1395571899,1,'hackersays.com'),(372,1559,'In seeking the unattainable, simplicity only gets in the way.','Alan J. Perlis',1395571899,1,'hackersays.com'),(373,1559,'If Java had true garbage collection, most programs would delete themselves upon execution.','Robert Sewell',1395571899,1,'hackersays.com'),(374,1559,'Three things should never be seen in the process of being created: laws, sausage, and software.','Anonymous',1395571899,1,'hackersays.com'),(375,1559,'Often it is the means that justify the ends: Goals advance technique and technique survives even when goal structures crumble.&lt;br&gt;','Alan J. Perlis',1395571899,1,'hackersays.com'),(376,1559,'God did not create the world in seven days; for six days he screwed around and then pulled an all-nighter.','Anonymous',1395571899,1,'hackersays.com'),(377,1559,'Prolonged contact with the computer turns mathematicians into clerks and vice versa.','Alan J. Perlis',1395571899,1,'hackersays.com'),(378,1559,'Now I\'m a pretty lazy person and am prepared to work quite hard in order to avoid work.','Martin Fowler',1395571899,1,'hackersays.com'),(379,1559,'The use of a program to prove the 4-color theorem will not change mathematics - it merely demonstrates that the theorem, a challenge for a century, is probably not important to mathematics.','Alan J. Perlis',1395571900,1,'hackersays.com'),(380,1559,'There are only two kinds of languages: the ones people complain about and the ones nobody uses.','Bjarne Stroustrup',1395571900,1,'hackersays.com'),(381,1559,'You start writing code, I\'ll go see what the customer wants','Anonymous',1395571900,1,'hackersays.com'),(382,1559,'Java. The elegant simplicity of C++. The blazing speed of Smalltalk.','Anonymous',1395571900,1,'hackersays.com'),(383,1559,'If it doesn\'t work, change the documentation.','Anonymous',1395571900,1,'hackersays.com'),(384,1559,'So many good ideas are never heard from again once they embark in a voyage on the semantic gulf.','Alan J. Perlis',1395571900,1,'hackersays.com'),(385,1559,'Lisp isn\'t a language, it\'s a building material.','Alan Kay',1395571900,1,'hackersays.com'),(386,1559,'There are two ways of constructing a software design: One way is to make it so simple that there are obviously no deficiencies, and the other way is to make it so complicated that there are no obvious deficiencies. The first method is far more difficult.','C.A.R. Hoare.',1395571901,1,'hackersays.com'),(387,1559,'The whole point of getting things done is knowing what to leave undone.','Oswald Chambers',1395571901,1,'hackersays.com'),(388,1559,'As soon as you agree on the number of spaces for indentation, no-one argues for tabs.','Alvar Lumberg',1395571901,1,'hackersays.com'),(389,1559,'Manually managing blocks of memory in C is like juggling bars of soap in a prison shower: It\'s all fun and games until you forget about one of them.','Anonymous',1395571901,1,'hackersays.com'),(390,1559,'Wherever there is modularity there is the potential for misunderstanding: Hiding information implies a need to check communication.','Alan J. Perlis',1395571901,1,'hackersays.com'),(391,1559,'Computer Science is no more about computers than astronomy is about telescopes.','E. W. Dijkstra',1395571901,1,'hackersays.com'),(392,1559,'Programming is an unnatural act.','Alan J. Perlis',1395571901,1,'hackersays.com'),(393,1559,'When I have a specific goal in mind and a complicated piece of code to write, I spend my time making it happen rather than telling myself stories about it.','Steve Yegge',1395571901,1,'hackersays.com'),(394,1559,'An ideal world is left as an exercise to the reader.','From Paul Graham\'s \"On Lisp\"',1395571901,1,'hackersays.com'),(395,1559,'Never trust a programmer in a suit.','Anonymous',1395571901,1,'hackersays.com'),(396,1559,'Purely applicative languages are poorly applicable.','Alan J. Perlis',1395571902,1,'hackersays.com'),(397,1559,'Users are a terrible thing. Systems would be infinitely more stable without them.','Michael T. Nygard.',1395571902,1,'hackersays.com'),(398,1559,'80 percent of my problems are simple logic errors. 80 percent of the remaining problems are pointer errors. The remaining problems are hard.','Mark Donner, IBM Watson Research Center',1395571902,1,'hackersays.com'),(399,1559,'C++ : Where friends have access to your private members.','Gavin Russell Baker',1395571902,1,'hackersays.com'),(400,1559,'Working software is the primary measure of progress.','Agile Manifesto',1395571902,1,'hackersays.com'),(401,1559,'I invented the term Object-Oriented, and I can tell you I did not have C++ in mind.','Alan Kay',1395571902,1,'hackersays.com'),(402,1559,'Computers are getting smarter all the time. Scientists tell us that soon they will be able to talk to us. (And by \'they\', I mean \'computers\'. I doubt scientists will ever be able to talk to us.)','Dave Barry',1395571903,1,'hackersays.com'),(403,1559,'If we believe in data structures, we must believe in independent (hence simultaneous) processing. For why else would we collect items within a structure? Why do we tolerate languages that give us the one without the other?','Alan J. Perlis',1395571903,1,'hackersays.com'),(404,1559,'The three chief virtues of a programmer are: Laziness, Impatience and Hubris.','Larry Wall',1395571903,1,'hackersays.com'),(405,1559,'Artificial Intelligence is no match for natural stupidity.','Anonymous',1395571903,1,'hackersays.com'),(406,1559,'Computer science education cannot make anybody an expert programmer any more than studying brushes and pigment can make somebody an expert painter.','Eric Raymond',1395571903,1,'hackersays.com'),(407,1559,'Only in wealth, there is room for a bad idea.','Jasper van der Meer',1395571903,1,'hackersays.com'),(408,1559,'Brevity is the soul of wit.','Shakespeare',1395571904,1,'hackersays.com'),(409,1559,'Programmer - an organism that turns coffee into software.','Anonymous',1395571904,1,'hackersays.com'),(410,1559,'We have the mini and the micro computer. In what semantic niche would the pico computer fall?','Alan J. Perlis',1395571904,1,'hackersays.com'),(411,1559,'The best code is no code at all.','Anonymous',1395571904,1,'hackersays.com'),(412,1559,'Remember, a great way to avoid broken code is to have less of it. The code that you never write will work forever.','Russ Olsen',1395571904,1,'hackersays.com'),(413,1559,'I would love to change the world, but they won\'t give me the source code.','Anonymous',1395571904,1,'hackersays.com'),(414,1559,'If it works, leave it alone &mdash; there\'s no need to understand it. If it fails, try to fix it &mdash; there\'s no time to understand it.','Bill Pfeifer',1395571904,1,'hackersays.com'),(415,1559,'To most Java developers, Ruby/Rails is like a mistress. Ruby/Rails is young, new, and exciting; but eventually we go back to old faithful, dependable, and employable Java with some new tricks and idioms and we are the better programmer for it.','Juixe TechKnow',1395571904,1,'hackersays.com'),(416,1559,'Any set of procedures, no matter how well intentioned or useful, that are too difficult to follow, will be circumvented.','Ravera\'s First Law of System Administration',1395571905,1,'hackersays.com'),(417,1559,'Mostly, when you see programmers, they aren\'t doing anything. One of the attractive things about programmers is that you cannot tell whether or not they are working simply by looking at them. Very often they\'re sitting there seemingly drinking coffee and gossiping, or just staring into space. What t','Charles M Strauss',1395571905,1,'hackersays.com'),(418,1559,'In programming, as in everything else, to be in error is to be reborn.','Alan J. Perlis',1395571905,1,'hackersays.com'),(419,1559,'Everything should be built top-down, except the first time.','Alan J. Perlis',1395571905,1,'hackersays.com'),(420,1559,'Software is under a constant tension. Being symbolic it is arbitrarily perfectible; but also it is arbitrarily changeable.','Alan J. Perlis',1395571905,1,'hackersays.com'),(421,1559,'In a world without walls and fences, who needs Windows and Gates?','Anonymous',1395571905,1,'hackersays.com'),(422,1559,'An idiot with a computer is a faster, better idiot.','Rich Julius',1395571905,1,'hackersays.com'),(423,1559,'People who think, &quot;Oh this is a one-off,&quot; need to be offed, or perhaps politely removed from the project.&lt;br&gt;','George Neville-Neil',1395571905,1,'hackersays.com'),(424,1559,'An expert is a man who has made all the mistakes that can be made in a very narrow field.','Niels Bohr',1395571906,1,'hackersays.com'),(425,1559,'There are no significant bugs in our released software that any significant number of users want fixed.','Bill Gates',1395571906,1,'hackersays.com'),(426,1559,'In my experience, one of the most significant problems in software development is assuming. If you assume a method will passed the right parameter value, the method will fail.','Paul M. Duvall',1395571906,1,'hackersays.com'),(427,1559,'... one of the main causes of the fall of the Roman Empire was that, lacking zero, they had no way to indicate successful termination of their C programs.','Robert Firth',1395571906,1,'hackersays.com'),(428,1559,'Fight code entropy.','John Carmack',1395571906,1,'hackersays.com'),(429,1559,'Beware of the Turing tar-pit in which everything is possible but nothing of interest is easy.','Alan J. Perlis',1395571907,1,'hackersays.com'),(430,1559,'The definition of insanity is doing the same thing over and over and expecting a different result.','Anonymous',1395571907,1,'hackersays.com'),(431,1559,'Blame doesn\'t fix bugs.','Anonymous',1395571907,1,'hackersays.com'),(432,1559,'Like wine, the mastery of programming matures with time. But, unlike wine, it gets sweeter in the process.','Lawrence Mucheka',1395571908,1,'hackersays.com'),(433,1559,'I finally found a definition for &quot;middleware&quot;. &quot;Middleware&quot; is the software nobody wants to pay for.&lt;br&gt;','Chris Stone',1395571908,1,'hackersays.com'),(434,1559,'Owning a computer without programming is like having a kitchen and using only the microwave oven.','Charles Petzold',1395571908,1,'hackersays.com'),(435,1559,'When you want to do something differently from the rest of the world, it\'s a good idea to look into whether the rest of the world knows something you don\'t.','Anonymous',1395571908,1,'hackersays.com'),(436,1559,'You&rsquo;ll spend far more time babysitting old technologies than implementing new ones.','Jason Hiner IT Dirty Secrets',1395571908,1,'hackersays.com'),(437,1559,'We better hurry up and start coding, there are going to be a lot of bugs to fix.','Anonymous',1395571908,1,'hackersays.com'),(438,1559,'Most people find the concept of programming obvious, but the doing impossible.','Alan J. Perlis',1395571908,1,'hackersays.com'),(439,1559,'Consider the postage stamp: its usefulness consists in the ability to stick to one thing until it gets there.','Josh Billings',1395571909,1,'hackersays.com'),(440,1559,'A language that doesn\'t affect the way you think about programming, is not worth knowing.','Alan J. Perlis',1395571909,1,'hackersays.com'),(441,1559,'There\'s no test like production.','Anonymous',1395571909,1,'hackersays.com'),(442,1559,'Lines of code are only worth counting, when time has come to delete them.','Anonymous',1395571910,1,'hackersays.com'),(443,1559,'Debugging is anticipated with distaste, performed with reluctance, and bragged about forever.','Dan Kaminsky',1395571910,1,'hackersays.com'),(444,1559,'They won\'t tell you that they don\'t understand it; they will happily invent their way through the gaps and obscurities.','V.A. Vyssotsky on software programmers and their v',1395571910,1,'hackersays.com'),(445,1559,'In a 5 year period we get one superb programming language. Only we can\'t control when the 5 year period will be.','Alan J. Perlis',1395571911,1,'hackersays.com'),(446,1559,'Human beings are not accustomed to being perfect, and few areas of human activity demand it. Adjusting to the requirement for perfection is, I think, the most difficult part of learning to program.','Anonymous',1395571911,1,'hackersays.com'),(447,1559,'One man\'s constant is another man\'s variable.','Alan J. Perlis',1395571911,1,'hackersays.com'),(448,1559,'You can have a negative percent chance of succeeding in a task. For example, if you have a -5% chance of succeeding, not only will you fail every time you make an attempt, you will also fail 1 in 20 times that you don\'t even try.','Anonymous',1395571912,1,'hackersays.com'),(449,1559,'Programming can be fun, so can cryptography; however they should not be combined.','Kreitzberg and Shneiderman',1395571912,1,'hackersays.com'),(450,1559,'The goal of computation is the emulation of our synthetic abilities, not the understanding of our analytic ones.','Alan J. Perlis',1395571912,1,'hackersays.com'),(451,1559,'Debugging is twice as hard as writing the code in the first place. Therefore, if you write the code as cleverly as possible, you are, by definition, not smart enough to debug it.','Brian Kernighan',1395571912,1,'hackersays.com'),(452,1559,'Every dark corner you haven\'t explored with your flashlight is full of bugs.','Kent Beck and Martin Fowler',1395571912,1,'hackersays.com'),(453,1559,'One who works with their hands is a laborer.&lt;br&gt;One who works with their hands and their mind is a craftsman.&lt;br&gt;One who works with their hands, mind and heart is an artist.&lt;br&gt;','Anonymous',1395571913,1,'hackersays.com'),(454,1559,'Debuggers don\'t remove bugs. They only show them in slow motion.','Anonymous',1395571913,1,'hackersays.com'),(455,1559,'C++ is to C as Lung Cancer is to Lung.','Anonymous',1395571913,1,'hackersays.com'),(456,1559,'C++ is more of a rube-goldberg type thing full of high-voltages, large chain-driven gears, sharp edges, exploding widgets, and spots to get your fingers crushed. And because of it\'s complexity many (if not most) of it\'s users don\'t know how it works, and can\'t tell ahead of time what\'s going to caus','Grant Edwards',1395571913,1,'hackersays.com'),(457,1559,'You can measure a programmer\'s perspective by noting his attitude on the continuing vitality of FORTRAN.','Alan J. Perlis',1395571913,1,'hackersays.com'),(458,1559,'It is often easier to not do something dumb than it is to do something smart.','Anonymous',1395571913,1,'hackersays.com'),(459,1559,'There is not now, nor has there ever been, nor will there ever be, any programming language in which it is the least bit difficult to write bad code.','Anonymous',1395571913,1,'hackersays.com'),(460,1559,'Perhaps if we wrote programs from childhood on, as adults we\'d be able to read them.','Alan J. Perlis',1395571913,1,'hackersays.com'),(461,1559,'A documented bug is not a bug; it is a feature.','James P. MacLennan',1395571913,1,'hackersays.com'),(462,1559,'A computer lets you make more mistakes faster than any other invention in human history, with the possible exceptions of handguns and tequila.','Mitch Ratcliffe',1395571913,1,'hackersays.com'),(463,1559,'Should array indices start at 0 or 1? My compromise of 0.5 was rejected without, I thought, proper consideration.','Stan Kelly-Bootle',1395571913,1,'hackersays.com'),(464,1559,'There are two major products that come out of Berkeley: LSD and UNIX. We don\'t believe this to be a coincidence.','Jeremy S. Anderson',1395571913,1,'hackersays.com'),(465,1559,'Good web applications should look like trifle.','Cal Henderson',1395571913,1,'hackersays.com'),(466,1559,'In man-machine symbiosis, it is man who must adjust: The machines can\'t.','Alan J. Perlis',1395571914,1,'hackersays.com'),(467,1559,'The C Programming Language &mdash; A language which combines the flexibility of assembly language with the power of assembly language.','Anonymous',1395571914,1,'hackersays.com'),(468,1559,'It&rsquo;s hardware that makes a machine fast. It&rsquo;s software that makes a fast machine slow.','Craig Bruce',1395571914,1,'hackersays.com'),(469,1559,'We will never run out of things to program as long as there is a single program around.','Alan J. Perlis',1395571914,1,'hackersays.com'),(470,1559,'The greatest performance improvement of all is when a system goes from not-working to working.','John Ousterhout',1395571914,1,'hackersays.com'),(471,1559,'The programmer, like the poet, works only slightly removed from pure thought-stuff. He builds his castles in the air, from air, creating by exertion of the imagination. Few media of creation are so flexible, so easy to polish and rework, so readily capable of realizing grand conceptual structures.','Frederick P. Brooks Jr.',1395571915,1,'hackersays.com'),(472,1559,'You can stand on the shoulders of giants OR a big enough pile of dwarfs, works either way.','Anonymous',1395571915,1,'hackersays.com'),(473,1559,'The structure of software systems tend to reflect the structure of the organization that produce them.','Douglas Crocford',1395571915,1,'hackersays.com'),(474,1559,'Programmers usually have good reasons for making bad decisions.','Anonymous',1395571915,1,'hackersays.com'),(475,1559,'APL, I believe, can only be learned by writing one-liners&ndash;only by seeing in a sense, what you can compress into a line.','Alan J Perlis',1395571915,1,'hackersays.com'),(476,1559,'It is easier to write an incorrect program than understand a correct one.','Alan J. Perlis',1395571916,1,'hackersays.com'),(477,1559,'There is nothing quite so permanent as a quick fix.','Anonymous',1395571916,1,'hackersays.com'),(478,1559,'What I cannot build, I do not understand.','Richard Feynman',1395571916,1,'hackersays.com'),(479,1559,'The best book on programming for the layman is &quot;Alice in Wonderland&quot;; but that\'s because it\'s the best book on anything for the layman.&lt;br&gt;','Alan J. Perlis',1395571916,1,'hackersays.com'),(480,1559,'The real money isn\'t in the software. It\'s in the service you build with that software.','Jeff Atwood',1395571916,1,'hackersays.com'),(481,1559,'Whenever two programmers meet to criticize their programs, both are silent.','Alan J. Perlis',1395571917,1,'hackersays.com'),(482,1559,'Designing software in a team is like writing poetry in a committee meeting.','Joel Spolsky',1395571917,1,'hackersays.com'),(483,1559,'Pasting code from the Internet into production code is like chewing gum found in the street.','Anonymous',1395571917,1,'hackersays.com'),(484,1559,'Once you understand how to write a program get someone else to write it.','Alan J. Perlis',1395571917,1,'hackersays.com'),(485,1559,'Writing in C or C++ is like running a chain saw with all the safety guards removed.','Bob Gray',1395571917,1,'hackersays.com'),(486,1559,'A programmer that is 10 times better than another will probably be happy making only 3 times as much.','Paul Graham',1395571917,1,'hackersays.com'),(487,1559,'Selecting a project due date before the requirements are properly gathered is like selecting which corner you want to paint yourself into, while simultaneously negating the doorway as a viable option.','Chris Ames',1395571917,1,'hackersays.com'),(488,1559,'A C program is like a fast dance on a newly waxed dance floor by people carrying razors.','Waldi Ravens',1395571917,1,'hackersays.com'),(489,1559,'We should forget about small efficiencies, say about 97% of the time: premature optimization is the root of all evil.','Donald Knuth',1395571917,1,'hackersays.com'),(490,1559,'It is easier to port a shell than a shell script.','Larry Wall',1395571917,1,'hackersays.com'),(491,1559,'As a rule, software systems do not work well until they have been used, and have failed repeatedly, in real applications.','Dave Parnas',1395571918,1,'hackersays.com'),(492,1559,'If your bug has a one in a million chance of happening, it\'ll happen next tuesday.','Anonymous',1395571918,1,'hackersays.com'),(493,1559,'... what society overwhelmingly asks for is snake oil. Of course, the snake oil has the most impressive names &mdash; otherwise you would be selling nothing &mdash; like &quot;Structured Analysis and Design&quot;, &quot;Software Engineering&quot;, &quot;Maturity Models&quot;, &quot;Management Inform','Edsger W. Dijkstra',1395571918,1,'hackersays.com'),(494,1559,'In computing, the mean time to failure keeps getting shorter.','Alan J. Perlis',1395571918,1,'hackersays.com'),(495,1559,'Any intelligent fool can make things bigger and more complex. It takes a touch of genius - and a lot of courage - to move in the opposite direction.','E.F. Schumacher',1395571918,1,'hackersays.com'),(496,1559,'The sooner we start coding fewer frameworks and more programs the sooner we&rsquo;ll become better programmers.','Warped Java Guy Elementary Java Solutions',1395571918,1,'hackersays.com'),(497,1559,'Adapting old programs to fit new machines usually means adapting new machines to behave like old ones.','Alan J. Perlis',1395571935,1,'hackersays.com'),(498,1559,'A good programmer looks both ways before crossing a one-way street.','Anonymous',1395571935,1,'hackersays.com'),(499,1559,'In software systems, it is often the early bird that makes the worm.','Alan J. Perlis',1395571935,1,'hackersays.com'),(500,1559,'If a listener nods his head when you\'re explaining your program, wake him up.','Alan J. Perlis',1395571936,1,'hackersays.com'),(501,1559,'Perfection is achieved, not when there is nothing more to add, but when there is nothing left to take away.','Antoine de Saint Exupéry',1395571936,1,'hackersays.com'),(502,1559,'Never memorize what you can look up in books.','Albert Einstein',1395571937,1,'hackersays.com'),(503,1559,'When I am working on a problem I never think about beauty. I think only how to solve the problem. But when I have finished, if the solution is not beautiful, I know it is wrong.','R. Buckminster Fuller',1395571937,1,'hackersays.com'),(504,1559,'Starting a startup is hard, but having a 9 to 5 job is hard too, and in some ways a worse kind of hard.','Paul Graham',1395571937,1,'hackersays.com'),(505,1559,'Documentation is like term insurance: It satisfies because almost no one who subscribes to it depends on its benefits.','Alan J. Perlis',1395571937,1,'hackersays.com'),(506,1559,'Software is either testable or detestable.','Anonymous',1395571937,1,'hackersays.com'),(507,1559,'As soon as we started programming, we found to our surprise that it wasn\'t as easy to get programs right as we had thought.','Maurice Wilkes',1395571938,1,'hackersays.com'),(508,1559,'It\'s OK to figure out murder mysteries, but you shouldn\'t need to figure out code. You should be able to read it.','Steve McConnell',1395571938,1,'hackersays.com'),(509,1559,'Like punning, programming is a play on words.','Alan J. Perlis',1395571938,1,'hackersays.com'),(510,1559,'Fifty years of programming language research, and we end up with C++ ?','Richard A. O\'Keefe',1395571938,1,'hackersays.com'),(511,1559,'It\'s hard enough to find an error in your code when you\'re looking for it; it\'s even harder when you\'ve assumed your code is error-free.','Steve McConnell',1395571938,1,'hackersays.com'),(512,1559,'Behind Every Successful Coder, there\'an even more successful De-Coder to understand that Code.','Anonymous',1395571939,1,'hackersays.com'),(513,1559,'If you want to set off and go develop some grand new thing, you don\'t need millions of dollars of capitalization. You need enough pizza and Diet Coke to stick in your refrigerator, a cheap PC to work on and the dedication to go through with it.','John Carmack',1395571939,1,'hackersays.com'),(514,1559,'It\'s not what the software does. It\'s what the user does.','Hugh Macleod',1395571939,1,'hackersays.com'),(515,1559,'Singleton is a misconcept in OOP unless it\'s used as a misconcepted paradigm for application development.','Anonymous',1395571939,1,'hackersays.com'),(516,1559,'In computing, turning the obvious into the useful is a living definition of the word &quot;frustration&quot;.&lt;br&gt;','Alan J. Perlis',1395571939,1,'hackersays.com'),(517,1559,'If you can\'t explain something to a six-year-old, you really don\'t understand it yourself.','Albert Einstein',1395571939,1,'hackersays.com'),(518,1559,'Team debugging: the act of intimidating a PC into doing for two people what it refuses to do for one.','Anonymous',1395571939,1,'hackersays.com'),(519,1559,'I (...) am rarely happier than when spending an entire day programming my computer to perform automatically a task that would otherwise take me a good ten seconds to do by hand.','Douglas Adams',1395571939,1,'hackersays.com'),(520,1559,'Simplicity is hard to build, easy to use, and hard to charge for. Complexity is easy to build, hard to use, and easy to charge for.','Chris Sacca',1395571940,1,'hackersays.com'),(521,1559,'God is a hacker, not an engineer. You can do reverse engineering, but you can&rsquo;t do reverse hacking.','Francis Crick',1395571940,1,'hackersays.com'),(522,1559,'Don&rsquo;t fix bugs later; fix them now.','Steve Maguire',1395571940,1,'hackersays.com'),(523,1559,'All real programmers know C of course.','Jeff Atwood',1395571940,1,'hackersays.com'),(524,1559,'If you can build it, your users can break it.','Anonymous',1395571940,1,'hackersays.com'),(525,1559,'When all you have is a hammer, everything starts to look like a nail.','Anonymous',1395571941,1,'hackersays.com'),(526,1559,'The string is a stark data structure and everywhere it is passed there is much duplication of process. It is a perfect vehicle for hiding information.','Alan J. Perlis',1395571941,1,'hackersays.com'),(527,1559,'People who find Wiki-markup too difficult to use and need a WYSIWYG-editor shouldn\'t be using a Wiki in the first place.','Anonymous',1395571941,1,'hackersays.com'),(528,1559,'If architects built houses the way programmers built programs, the first woodpecker to come along would destroy civilization.','Gerald Weinberg',1395571941,1,'hackersays.com'),(529,1559,'C++ is more of a rube-goldberg type thing full of high-voltages, large chain-driven gears, sharp edges, exploding widgets, and spots to get your fingers crushed. And because of it\'s complexity many (if not most) of it\'s users don\'t know how it works, and can\'t tell ahead of time what\'s going to caus','Grant Edwards',1395571941,1,'hackersays.com'),(530,1559,'There are only 3 numbers of interest to a computer scientist: 1, 0 and infinity.','Anonymous',1395571941,1,'hackersays.com'),(531,1559,'The best thing about a boolean is even if you are wrong, you are only off by a bit.','Anonymous',1395571941,1,'hackersays.com'),(532,1559,'A programmer started to cuss&lt;br&gt;Because getting to sleep was a fuss&lt;br&gt;As he lay there in bed&lt;br&gt;Looping \'round in his head&lt;br&gt;was: while(!asleep()) sheep++;&lt;br&gt;','Anonymous',1395571941,1,'hackersays.com'),(533,1559,'Any sufficiently advanced magic is indistinguishable from a rigged demonstration.','Anonymous',1395571942,1,'hackersays.com'),(534,1559,'We are on the verge: Today our program proved Fermat\'s next-to-last theorem.','Alan J. Perlis',1395571942,1,'hackersays.com'),(535,1559,'It is not a language\'s weakness but its strengths that control the gradient of its change: Alas, a language never escapes its embryonic sac.','Alan J. Perlis',1395571942,1,'hackersays.com'),(536,1559,'If we\'re supposed to work in Hex, why have we only got A fingers?','Anonymous',1395571942,1,'hackersays.com'),(537,1559,'A computer scientist counts to ten: 0, 1, 2, 3, 4 ...&lt;br&gt;Everyone else counts to ten: 1, 2, 3, 4, 5&lt;br&gt;','Anonymous',1395571943,1,'hackersays.com'),(538,1559,'... what society overwhelmingly asks for is snake oil. Of course, the snake oil has the most impressive names &mdash; otherwise you would be selling nothing &mdash; like &quot;Structured Analysis and Design&quot;, &quot;Software Engineering&quot;, &quot;Maturity Models&quot;, &quot;Management Inform','Edsger W. Dijkstra',1395571943,1,'hackersays.com'),(539,1559,'Development has two outputs... Code &amp; Bugs','Anonymous',1395571944,1,'hackersays.com'),(540,1559,'The evolution of languages: FORTRAN is a non-typed language. C is a weakly typed language. Ada is a strongly typed language. C++ is a strongly hyped language.','Ron Sercely',1395571944,1,'hackersays.com'),(541,1559,'It is easier to change the specification to fit the program than vice versa.','Alan J. Perlis',1395571944,1,'hackersays.com'),(542,1559,'In the good old days physicists repeated each other\'s experiments, just to be sure. Today they stick to FORTRAN, so that they can share each other\'s programs, bugs included.','Edsger W. Dijkstra',1395571944,1,'hackersays.com'),(543,1559,'I couldn\'t resist the temptation to put in a null reference, simply because it was so easy to implement. This has led to innumerable errors, vulnerabilities, and system crashes, which have probably caused a billion dollars of pain and damage in the last forty years.','Tony (C.A.R.) Hoare',1395571945,1,'hackersays.com'),(544,1559,'&quot;It depends&quot; is the answer to all good software engineering questions, but to be a good software engineer, you should know on what it depends, and why.&lt;br&gt;','Anonymous',1395571945,1,'hackersays.com'),(545,1559,'Must be zero, or equal to MAPI_UNICODE. In either case, however, this parameter is ignored.','MSDN',1395571945,1,'hackersays.com'),(546,1559,'There are only two hard problems in Computer Science: cache invalidation and naming things.','Phil Karlton',1395571946,1,'hackersays.com'),(547,1559,'Don\'t worry if it doesn\'t work right. If everything did, you\'d be out of a job.','Mosher\'s Law of Software Engineering',1395571946,1,'hackersays.com'),(548,1559,'Any fool can write code that a computer can understand. Good programmers write code that humans can understand.','Martin Fowler',1395571946,1,'hackersays.com'),(549,1559,'Code reuse is the Holy Grail of Software Engineering.','Douglas Crockford',1395571946,1,'hackersays.com'),(550,1559,'I have always wished for my computer to be as easy to use as my telephone; my wish has come true because I can no longer figure out how to use my telephone.','Bjarne Stroustrup',1395571946,1,'hackersays.com'),(551,1559,'What you&rsquo;ve described, &ldquo;The bottleneck in writing code isn&rsquo;t in the writing of the code, it&rsquo;s in understanding and conceptualising what needs to be done,&rdquo; is common to all highly abstract programming 