l',1395571949,1,'hackersays.com'),(565,1559,'Web Development is a lot like kickboxing: You have to watch your cookies.','Anonymous',1395571949,1,'hackersays.com'),(566,1559,'Java is like a variant of the game of Tetris in which none of the pieces can fill gaps created by the other pieces, so all you can do is pile them up endlessly.','Steve Yegge',1395571949,1,'hackersays.com'),(567,1559,'Documentation is like sex. When it\'s good, it\'s fantastic. When it\'s bad, it\'s still better than nothing.','Anonymous',1395571949,1,'hackersays.com'),(568,1559,'I Hate Programming.&lt;br&gt;I Hate Programming.&lt;br&gt;I Hate Programming.&lt;br&gt;It works!&lt;br&gt;I Love Programming.&lt;br&gt;','Anonymous',1395571949,1,'hackersays.com'),(569,1559,'If at first you don\'t succeed, try/catch, try/catch again.','Anonymous',1395571950,1,'hackersays.com'),(570,1559,'The key to performance is elegance, not battalions of special cases.','Jon Bentley and Doug McIlroy',1395571950,1,'hackersays.com'),(571,1559,'Think of it this way: threads are like salt, not like pasta. You like salt, I like salt, we all like salt. But we eat more pasta.','Larry McVoy',1395571950,1,'hackersays.com'),(572,1559,'Profanity is the one language all programmers know best.','Anonymous',1395571950,1,'hackersays.com'),(573,1559,'Within a computer natural language is unnatural.','Alan J. Perlis',1395571950,1,'hackersays.com'),(574,1559,'Good architecture is necessary to give programs enough structure to be able to grow large without collapsing into a puddle of confusion.','Douglas Crockford',1395571951,1,'hackersays.com'),(575,1559,'Some programmers, when confronted with a problem, think &quot;I know, I\'ll use floating point arithmetic.&quot; Now they have 1.999999999997 problems.','Tom Scott',1395571951,1,'hackersays.com'),(576,1559,'If we\'d asked the customers what they wanted, they would have said &quot;faster horses&quot;.&lt;br&gt;','Henry Ford',1395571952,1,'hackersays.com'),(577,1559,'I will not be a lemming and follow the crowd over the cliff and into the C.','John Beidler',1395571952,1,'hackersays.com'),(578,1559,'I hate code, and I want as little of it in our product as possible.','Jack Diedrich',1395571953,1,'hackersays.com'),(579,1559,'Think of all the psychic energy expended in seeking a fundamental distinction between &quot;algorithm&quot; and &quot;program&quot;.&lt;br&gt;','Alan J. Perlis',1395571954,1,'hackersays.com'),(580,1559,'Editing is a rewording activity.','Alan J. Perlis',1395571954,1,'hackersays.com'),(581,1559,'The most important computer is the one that rages in our skulls and ever seeks that satisfactory external emulator. The standarization of real computers would be a disaster - and so it probably won\'t happen.','Alan J. Perlis',1395571955,1,'hackersays.com'),(582,1559,'If you don\'t have time to do it right, when will you have time to do it over?','John Wooden, basketball coach',1395571955,1,'hackersays.com'),(583,1559,'If you\'re going to break it, then break it good. Break everything. Get to the very front of the line. Don\'t like move up a couple of slots. That\'s pointless.','Anders Hejlsberg',1395571955,1,'hackersays.com'),(584,1559,'Make no mistake about it: Computers process numbers - not symbols. We measure our understanding (and control) by the extent to which we can arithmetize an activity.&lt;br&gt;','Alan J. Perlis',1395571955,1,'hackersays.com'),(585,1559,'C++ is more of a rube-goldberg type thing full of high-voltages, large chain-driven gears, sharp edges, exploding widgets, and spots to get your fingers crushed. And because of it\'s complexity many (if not most) of it\'s users don\'t know how it works, and can\'t tell ahead of time what\'s going to caus','Grant Edwards',1395571956,1,'hackersays.com'),(586,1559,'With all due respect John, I am the head of IT and I have it on good authority. If you type &quot;Google&quot; into Google, you can break the Internet.&lt;br&gt;','Jen, \"The IT Crowd\"\n',1395571956,1,'hackersays.c