arts you are reassembling were disassembled by you. Therefore, if you can\'t get them together again, there must be a reason. By all means, do not use a hammer.','IBM Manual, 1925',1395571966,1,'hackersays.com'),(618,1559,'Ever spend a little time reading comp.lang.c++ ? That\'s really the best place to learn about the number of C++ users looking for a better language.','R. William Beckwith',1395571966,1,'hackersays.com'),(619,1559,'Computers are useless. They can only give you answers.','Pablo Picasso',1395571966,1,'hackersays.com'),(620,1559,'The bearing of a child takes nine months, no matter how many women are assigned. Many software tasks have this characteristic because of the sequential nature of debugging.','Fred Brooks',1395571966,1,'hackersays.com'),(621,1559,'[The common definition of estimate is] &quot;An estimate is the most optimistic prediction that has a non-zero probability of coming true&quot; . . .&lt;br&gt;Accepting this definition leads irrevocably toward a method called what\'s-the-earliest- date-by-which-you-can\'t-prove-you-won\'t-be- finished ','Tom DeMarco',1395571966,1,'hackersays.com'),(622,1559,'The only &quot;intuitive&quot; interface is the nipple. After that it\'s all learned.','Bruce Ediger',1395571967,1,'hackersays.com'),(623,1559,'Sure, it\'s overkill. But you can never have too much overkill...','Anonymous',1395571968,1,'hackersays.com'),(624,1559,'If the automobile had followed the same development cycle as the computer, a Rolls-Royce would today cost $100, get a million miles per gallon, and explode once a year, killing everyone inside.','Robert X. Cringely',1395571969,1,'hackersays.com'),(625,1559,'C is quirky, flawed and an enormous success.','Dennis Ritchie',1395571969,1,'hackersays.com'),(626,1559,'Rules for optimization:&lt;br&gt;1. Don\'t do it.&lt;br&gt;2. (for experts only) Don\'t do it yet.&lt;br&gt;','Michael A Jackson',1395571970,1,'hackersays.com'),(627,1559,'C++ is more of a rube-goldberg type thing full of high-voltages, large chain-driven gears, sharp edges, exploding widgets, and spots to get your fingers crushed. And because of it\'s complexity many (if not most) of it\'s users don\'t know how it works, and can\'t tell ahead of time what\'s going to caus','Grant Edwards',1395571971,1,'hackersays.com'),(628,1559,'Going from programming in Pascal to programming in C, is like learning to write in Morse code.','J.P. Candusso',1395571971,1,'hackersays.com'),(629,1559,'Beware of bugs in the above code; I have only proved it correct, not tried it.','Donald Knuth',1395571972,1,'hackersays.com'),(630,1559,'The third version is the first version that doesn\'t suck.','Mike Simpson',1395571972,1,'hackersays.com'),(631,1559,'Professionalism has no place in art, and hacking is art. Software Engineering might be science; but that\'s not what I do. I\'m a hacker, not an engineer.','Jamie Zawinski',1395571973,1,'hackersays.com'),(632,1559,'I have always found that plans are useless, but planning is indispensable.','Dwight D. Eisenhower',1395571974,1,'hackersays.com'),(633,1559,'If it doesn\'t work, it doesn\'t matter how fast it doesn\'t work.','Ravera\'s observation on premature optimization',1395571974,1,'hackersays.com'),(634,1559,'It always takes longer than you expect, even when you take into account Hofstadter\'s Law.','Hofstadter\'s Law',1395571975,1,'hackersays.com'),(635,1559,'When someone says &quot;I want a programming language in which I need only say what I wish done,&quot; give him a lollipop.&lt;br&gt;','Alan J. Perlis',1395571975,1,'hackersays.com'),(636,1559,'Good design adds value faster than it adds cost.','Thomas C. Gale',1395571976,1,'hackersays.com'),(637,1559,'Design bugs are often subtle and occur by evolution with early assumptions being forgotten as new features or uses are added to a system.','Fernando J. Corbató',1395571976,1,'hackersays.com'),(638,1559,'For every complex problem there is an answer that is clear, simple, and wrong.','H L Mencken',1395571978,1,'hackersays.com'),(639,1559,'Mostly, when you see programmers, they aren\'t doing anything. One of the attractive things about programmers is that you cannot tell whether or not they are working simply by looking at them. Very often they\'re sitting there seemingly drinking coffee and gossiping, or just staring into space. What t','Charles M Strauss',1395571978,1,'hackersays.com'),(640,1559,'When a professor insists computer science is X but not Y, have compassion for his graduate students.','Alan J. Perlis',1395571979,1,'hackersays.com'),(641,1559,'It should be noted that no ethically-trained software engineer would ever consent to write a DestroyBaghdad procedure. Basic professional ethics would instead require him to write a DestroyCity procedure, to which Baghdad could be given as a parameter.','Nathaniel S Borenstein',1395571979,1,'hackersays.com'),(642,1559,'A logician trying to explain logic to a programmer is like a cat trying to explain to a fish what it\'s like to get wet.','Anonymous',1395571979,1,'hackersays.com'),(643,1559,'Re graphics: A picture is worth 10K words - but only those to describe the picture. Hardly any sets of 10K words can be adequately described with pictures.','Alan J. Perlis',1395571980,1,'hackersays.com'),(644,1559,'Vi is a subset of evil.','Anonymous',1395571982,1,'hackersays.com'),(645,1559,'If a program manipulates a large amount of data, it does so in a small number of ways.','Alan J. Perlis',1395571982,1,'hackersays.com'),(646,1559,'The most likely way for the world to be destroyed, most experts agree, is by accident. That\'s where we come in; we\'re computer professionals. We cause accidents.','Nathaniel Borenstein',1395571983,1,'hackersays.com'),(647,1559,'PHP is a minor evil perpetrated and created by incompetent amateurs, whereas Perl is a great and insidious evil perpetrated by skilled but perverted professionals.','Jon Ribbens',1395571984,1,'hackersays.com'),(648,1559,'Process is no substitute for synaptic activity.','Jeff D