s must be deleted at once, but leave this e-mail behind.\r\n\r\nI want them to know we are faster than they could ever become.',55,'0',0,'','',0,'sender@domain.com',1000,NULL,NULL,NULL,NULL,NULL),(92,'A-Lenses - For a clearer future','We hope you&#039;re having a pleasant day, USERNAME.\r\n\r\nHere is your weekly newsletter from Alpha Corporation.\r\n  \r\nA-Lenses are technology aware contact lenses, by Alpha. \r\n\r\nThese state of the art non-intrusive devices seemingly integrate into your day to day life upgrading your eyesight with an entirely new experience.\r\n\r\n With A-Lenses and image is worth two thousand words.\r\n\r\nAvailable at tech-dealers near you.\r\n',57,'0',0,'','',0,'marketing@alpha.grid',1000,NULL,NULL,NULL,NULL,NULL),(93,'Earn money fast!','Hey there USERNAME,\r\n\r\nMy name is Michael Subtorn and I&#039;ve used a special technique and took advantage of the full power of the grid to earn a huge amount of money in a very short amount of time (less than two weeks).\r\n\r\nMany other&#039;s have used this technique and reproduced my results. don&#039;t you want to be one of them?\r\n\r\nGet back to me if you&#039;d like to know more about how to become one of the richest people on the face of the grid.\r\n\r\nSee ya in money,\r\nMichael Subtorn',57,'0',0,'','',0,'michael@getriich.rich',1000,NULL,NULL,NULL,NULL,NULL),(94,'Omega','Hello USERNAME,\r\n\r\nMy name is.. not so important.\r\n\r\nWe are.. more than you think.\r\n\r\nWe&rsquo;ve received word from our informers that you want to join our ranks.\r\n\r\nThink of this as a.. single-elimination round.\r\n\r\nYour first clue: IRP_4_3\r\n\r\nYour second clue is: IP_2\r\n\r\nExtra hint for second clue: What is the answer to life the universe and everything?\r\n\r\nGood luck hacker,\r\nThe Omega\'s\r\n\r\nP.S.\r\n\'The desire for fame tempts even noble minds\' -  St. Augustine The City of God\r\n',57,'0',0,'','',0,'unknown',1000,NULL,NULL,NULL,NULL,NULL),(95,'USERNAME.omega','You managed to break into a node of the Alpha grid. Quite impressive if I might say so myself.\r\n\r\nAlso decrypting this file couldn&#039;t have been that easy.\r\n\r\nHere&#039;s your next clues:\r\nIHP_4_3\r\n',60,'5',0,'','',0,NULL,1000,NULL,NULL,NULL,NULL,NULL),(96,'USERNAME.readme','Looks like you did it.\r\n\r\nYou passed your first challenge. Easy peasy, wasn&#039;t it?\r\n\r\nWe&#039;ll examine your progress and get back to you as soon as possible.\r\n\r\nSharpen your skill as much as possible in the meantime.\r\n\r\nYour final task is to delete this file from this server.\r\n\r\nKeep hacking,\r\nOmega&#039;s',62,'0',0,'','',0,NULL,1000,NULL,NULL,NULL,NULL,NULL),(97,'Devils\' Den','This e-mail adress you were presented with, use it with pride, as you are one of the few true citizens of our society. \r\n\r\nYou are to use this e-mail adress only on missions, as we don\'t like to confuse public activities with work.',67,'0',0,'','',0,'dd@a.com',1000,NULL,NULL,NULL,NULL,NULL),(98,'First Mission','Your first mission was assigned. Do it at your own leasure, but remind yourself that we will take note of your each and every step.',67,'0',0,'','',0,'dd@a.com',1000,NULL,NULL,NULL,NULL,NULL),(99,'Congratulations','Even if you weren\'t able to find any definitive proof that someone messed with our server, you still did a pretty good job.\r\n\r\nWe\'ll make sure to give you jobs on your level from now on.',67,'0',0,'','',0,'dd@a.com',1000,NULL,NULL,NULL,NULL,NULL),(100,'don\'t get cocky','You are still at it huh? \r\nI guess the guys high up are out of their minds if they intend to keep someone like you around.\r\n\r\nConsider this e-mail a chance at redemtion...\r\n\r\nP.S. I don\'t know if you are worth the time, so I am going to crack a few servers here and there. \r\n\r\nCatch me if you can.',67,'0',0,'','',0,'sender@domain.com',1000,NULL,NULL,NULL,NULL,NULL),(105,'Common Gound','IP_2\r\n\r\n\r\nI guess you need this, right?',67,'0',0,'','',0,'jhone@a.com',1000,NULL,NULL,NULL,NULL,NULL),(106,'DataLog701240710','',68,'1000000',0,'','',0,NULL,1000,NULL,NULL,NULL,NULL,NULL),(107,'DataLog701240711','',68,'1000000',0,'','',0,NULL,1000,NULL,NULL,NULL,NULL,NULL),(108,'nice_one','You gave me a heart attack when you pingged this terminal. Seriously, stop it man. I didn\'t even finish reading and deleting these files.',68,'0',0,'','',0,NULL,1000,NULL,NULL,NULL,NULL,NULL),(109,'Fudge_Cake','This cake is extremely rich and moist, hence its name. Chocolate cake mix, chocolate pudding, and chocolate chips triple your chocolate pleasure. Feel free to experiment by using different flavored chips or nuts. This is a traditional recipe passed down from at least the early 1970\'s. I\'m not sure of its origin, but my old recipe card is quite yellowed and spotted with use so I would be hard-pressed to even guess at the originator. It is definitely worth the indulgence, but do not over-bake! You can also make mini-muffins from this recipe.\r\nPrep Time: 10 minutes\r\n\r\nCook Time: 55 minutes\r\n\r\nTotal Time: 1 hour, 5 minutes\r\n\r\nYield: 10 to 12 servings\r\n\r\nIngredients:\r\n\r\n1 package (about 18.25 ounces) chocolate fudge cake mix or devil\'s food cake mix, unprepared\r\n1 (3-ounce) package instant chocolate pudding mix (I use extra-dark)\r\n1 cup sour cream\r\n4 large eggs\r\n1/2 cup vegetable oil\r\n1/2 cup water\r\n1 (6-ounce) bag of semi-sweet or dark chocolate chips, chilled\r\nConfectioner\'s (powdered) sugar, optional\r\nPreparation:\r\n\r\nPreheat oven to 350 degrees F. Grease and flour a Bundt pan or angel food cake pan. \r\n\r\nBeat cake mix, pudding mix, sour cream, eggs, vegetable oil, and water together in a large bowl for 2 minutes at medium speed. Fold in chocolate chips by hand. Pour evenly into prepared pan. \r\n\r\nBake for 55 minutes. Do not over-bake. Let cool on a rack for 15 minutes. Place a large cake dish or platter over the top of the pan. Turn it over and gently tap until the cake releases. If the cake is stubborn to release, use a rubber spatula around the edge and center of the pan to ease it free, and try again. \r\n\r\nLet cake cool completely, then sift powdered sugar over the top or drizzle with a simple glaze of powdered sugar and milk or cream. \r\n\r\nYield: 10 to 12 servings \r\n\r\nTo Make Mini-Muffins: Preheat oven to 350 degrees F. Prepare batter as above. Line mini-muffin tins with muffin papers. Fill 2/3 full. Bake about 14 minutes. \r\n\r\nNotes: \r\n&bull; The original recipe uses a plain chocolate cake mix and vanilla pudding. I\'ve tripled the chocolate richness with a fudge cake mix, dark chocolate pudding, and dark chocolate chips. Feel free to stick with the original, if you like. \r\n\r\n&bull; Most cake mixes these days already have pudding in the mix, and they still work just fine. ',69,'0',0,'','',0,NULL,1000,NULL,NULL,NULL,NULL,NULL),(110,'Dump_Cake','This recipe is designed for kids to bake. It\'s incredibly easy with no mixing involved. Canned fruits are dumped into a baking pan, topped with cake mix, butter, and nuts, then baked. The result is something in between a cake and a cobbler, and amazingly delicious. Adults will also love this recipe.\r\nPrep Time: 10 minutes\r\n\r\nCook Time: 1 hour\r\n\r\nTotal Time: 1 hour, 10 minutes\r\n\r\nYield: 10 to 12 servings\r\n\r\nIngredients:\r\n\r\n1 (20 ounces) can crushed pineapple, undrained\r\n1 (21 ounces) can prepared more fruit cherry pie filling\r\n1 (18.25 ounces) box yellow cake mix\r\n2 sticks (1 cup or 16 Tablespoons) of butter or margarine, each cut into 12 slices\r\n1/4 cup chopped nuts (pecans, walnuts, pistachios, cashews, peanuts, etc., your choice)\r\nPreparation:\r\n\r\nPreheat oven to 350 degrees F (325 for glass baking dish). Have a 9 by 13-inch baking pan ready. \r\n\r\nDump undrained pineapple baking dish or pan and spread it out evenly. \r\n\r\nUsing a spoon, dump globs of cherry pie filling evenly on top of the pineapple. \r\n\r\nSprinkle the cake mix evenly over the cherry and pineapple layers. \r\n\r\nCut butter into slices with a butter knife and place slices evenly over cake mix. \r\n\r\nSprinkle nuts on top if you\'re using them. \r\n\r\nBake for one hour. Use heavy oven mitts to remove the dump cake from oven or let your older helper do it. \r\n\r\nTo serve, scoop cake out with a large spoon like a cobbler, and dump it on a nice plate. A scoop of vanilla ice cream is delicious with dump cake. Serve warm or cold. \r\n\r\nYield: about 10 to 12 servings ',69,'0',0,'','',0,NULL,1000,NULL,NULL,NULL,NULL,NULL),(111,'Yellow_Cake','Everyone will enjoy this moist yellow cake recipe made from scratch. Be sure to check at the bottom for more great cake recipes.\r\nBest Way to Print This Recipe\r\n\r\nPrep Time: 15 minutes\r\n\r\nCook Time: 25 minutes\r\n\r\nTotal Time: 40 minutes\r\n\r\nYield: Two 9-inch Cake Rounds\r\n\r\nIngredients:\r\n\r\n2 cups cake flour\r\n2 teaspoons baking powder\r\n1/2 teaspoon salt\r\n1/2 cup butter, softened\r\n1 cup sugar\r\n3 large eggs, room temperature\r\n2 teaspoons vanilla\r\n3/4 cup milk\r\nPreparation:\r\n\r\nPreheat oven to 350&deg;F. Grease and flour 2 9-inch cake pans.\r\nIn bowl, combine flour, baking powder, and salt with a wire whisk.\r\n\r\nCream butter and sugar until light and fluffy. Beat in eggs, one at a time. Add vanilla and mix until completely combines. Slowly add flour alternately with milk. At end of addition batter should be smooth. Divide between 2 pans.\r\n\r\nBake Yellow Cake Recipe for 20 to 25 minutes. Cool 5 minutes in pan, then invert onto a rack and cool completely before frosting.\r\n\r\nFor a 9 x 13 pan - Baked at 350 degrees F. for 30 to 38 minutes.',69,'0',0,'','',0,NULL,1000,NULL,NULL,NULL,NULL,NULL),(112,'The_Alpha-Killers','You have no ideea what you are getting into.',70,'0',0,'','',0,NULL,1000,NULL,NULL,NULL,NULL,NULL),(113,'Quiiiiiiiiiiiiiiiz_Timeeeeeeeeeeeeee!','To Make Mini-Muffins: How many minutes do you have to let them in the oven?\r\n\r\n\r\nssh IP_5',71,'0',0,'','',0,NULL,1000,NULL,N