INSERT INTO `quest_objectives` VALUES (18,8,'hack',NULL,'Congratz it works\r\n\r\nIP_2','IP_2',9,0,0,0),(19,10,'ping',NULL,'','',0,0,0,0),(46,10,'decrypt_file',19,'','',0,0,0,0),(47,8,'ping',NULL,'dfasfsadf','IP_2',6,0,0,0),(48,8,'ping',18,'','',0,0,2,0),(49,8,'ping',47,'',NULL,0,NULL,NULL,0),(72,20,'ping',NULL,'Should give 3000 seconds extra time and an achievement, Test.\r\n\r\nOrder 0. Decrypt enc.\r\n\r\nRAND_S_1_10\r\n\r\nRAND_S_1_20',NULL,0,0,2,0),(73,20,'ping',NULL,'Another 3000 extra time.\r\n\r\nOrder 1.\r\n\r\nAchievement test 2\r\n\r\nRun canrun:IP_0:100\r\n\r\nRAND_S_0_20\r\nRAND_S_1_20\r\nRAND_S_2_20\r\nRAND_S_3_20',NULL,1,3000,3,0),(74,20,'ping',NULL,'Order 2 \r\n\r\nkill file\r\n\r\nencrunrun:IP_0:100\r\n\r\nRAND_S_2_20\r\nRAND_S_3_20',NULL,2,0,0,0),(75,20,'ping',73,'',NULL,0,NULL,NULL,0),(76,20,'ping',NULL,'Crack IP_1 on port 120\r\n\r\nIP_1:120\r\n\r\nHas sub-objective of nmap IP_1 with achievement && time 1000!\r\n\r\nRAND_S_0_20\r\nRAND_S_1_20\r\nRAND_S_2_20\r\nRAND_S_3_20',NULL,3,0,0,0),(77,20,'nmap',76,'','IP_1',0,1000,4,0),(78,20,'ping',NULL,'Ping IP_1\r\n\r\nThat\'s it. Nice right?','IP_1',4,0,0,0),(79,20,'connect',NULL,'Connect to IP_1:120','IP_1:120',5,0,0,0),(80,20,'delete_file',NULL,'Delete .hidden file from IP_1:120\r\n','.hidden',6,0,0,0),(81,20,'transfer',NULL,'Transfer from IP_1:120 transfermetomain to main\r\n\r\nSideobjective decrypt transfermetomain Gives 1000 extra time','transfermetomain|IP_0:100',7,0,0,0),(82,20,'decrypt_file',81,'','transfermetomain',0,1000,0,0),(83,20,'ping',NULL,'cat canrun',NULL,8,0,3,0),(84,20,'connect',NULL,'asfas \r\n\r\nconnect to IP_1:130','IP_1:130',9,0,0,0),(85,20,'delete_email',NULL,'Main objective delete email 1 IP_1:130\r\n\r\nSecondary objective Read email 0|IP_1:130\r\n\r\nSecondary objective forward email 0|USERNAME@secretrepublic.net|IP_1:130','1|IP_1:130',10,0,0,0),(86,20,'read_email',85,'','0|IP_1:130',0,0,0,0),(87,20,'forward_email',85,'','0|USERNAME@secretrepublic.net|IP_1:130',0,0,0,0),(88,20,'sql_delete',NULL,'users|1|IP_1:140','users|1|IP_1:140',11,0,0,0),(89,22,'ping',NULL,'Hello USERNAME,\r\n\r\nWe\'ve seen your interest data decryption gigs. Fortunately, we\'ve recently put our hands on some... sensitive data. Our analysts would be able to make sense of it, but it\'s been heavily encrypted.\r\n\r\nThat\'s where you come in. We\'ve placed the files on a temporary server.\r\n\r\nHere\'s the IP address: IP_1\r\n\r\nAn SSH service is online on the default port (22).\r\n\r\nWe hope you are up for the job,\r\nSee you in hell.\r\n[i]Email received from unknown location[/i]',NULL,1,0,0,0),(90,23,'run_file',NULL,'Think fast, USERNAME.\r\n\r\nWe\'ve placed a special file on your system. Find it, decrypt it and run it.\r\n\r\nMore details later on.\r\n\r\nTic-tac, tic-tac, the clock starts and never stops.','run.me',1,300,0,0),(91,23,'ping',NULL,'We acknowledge your skills.\r\n\r\nSorry for putting you through a test so out of a sudden, but it was.. necessary.\r\n\r\nOn the dark side of things, we need you to hack into a couple of servers, decrypt the files you find there and transfer them back on your server.\r\n\r\nFirst things first. Make your way into IP_1, there\'s an SSH service running somewhere on there and some of our competitor\'s files should be inside.\r\n\r\nTime is of the essence.',NULL,2,0,0,0),(92,24,'ping',NULL,'Welcome, [color=cyan]USERNAME.[/color]\r\nAs your AI, I will guide you through each and every mission you receive as time goes on.\r\n\r\nYour first objective is to [color=orange]ping[/color] and connect to the main [color=orange]SSH[/color] server of one of our companies that we believe has become corrupted. Available ports are 89 or 510 as the server has two services running on it.\r\n\r\nThe IP address is IP_1. \r\n\r\nAs the server may still have some sort of protection I was instructed to advise you to use the &quot;[color=orange]crack[/color]&quot; command if you encounter any difficulties in your attempt at connecting to the server. \r\n\r\n[color=red]Reminder: The crack and connect commands must be followed by the port adress you want to connect to.\r\n\r\nReminder: To connect to a server you must first introduce the service type it\'s using, then it\'s IP and port. \r\n[/color]\r\n [color=cyan]Example:\r\nssh IP_1 89[/color]\r\n\r\n[color=red]Reminder: Use a space to separate the port number from the IP number.\r\n[/color]',NULL,0,60,0,0),(93,24,'ping',NULL,'That IP is... the adress of an e-mail server? \r\n\r\nUpon further inspection the server seems to be a basic [color=orange]SMTP[/color]. It has... a multitude of ports available... almost entirely open.\r\n\r\nThe whole situation seems fishy.\r\n\r\nI suggest using the most secure port available: 3123. \r\n\r\nIt\'s not much I can do to prevent any sort of malware infiltrating our server once you are connected to it.\r\n\r\n[color=cyan]It\'s your call.[/color]\r\n\r\n...but, I guess you can always resort to bouncing...\r\n\r\n[color=red] Reminder: What bouncing does is when you connect to an IP and port, it will redirect your connection through all of the servers on the bounce list. Trace level increases slower but logs are made on all used servers. You can add only servers of which services you have all cracked. You can bounce a limited amount of times through each server.\r\n\r\nReminder: To add a server to your bouncing list you must use the &quot;[/color][color=orange]bounce[/color][color=red]&quot; command followed by the action you want to do, [/color][color=orange]add/remove[/color][color=red], then typing the IP and port adress.\r\n\r\nReminder: To check the staus of your bouncing list, type &quot;[/color][color=orange]bounce status[/color][color=red]&quot;.\r\n[/color]',NULL,2,120,0,0),(95,24,'ping',NULL,'In order to navigate a SSH server, you must first know more about this service.\r\n\r\nA SSH server  contains files, most of the time. As with every type of server everything is done via the console.\r\nYou can see the files of a SSH server by using of the &quot;[color=orange]ls[/color]&quot; command.\r\n\r\n[color=red]Reminder: Files can be either executables or documents. Use the &quot;[/color][color=orange]cat[/color][color=red]&quot; command followed by the name of the file to read it. Use the &quot;[/color][color=orange]run[/color][color=red]&quot; command followed by the name of the file to run it.[/color]\r\n\r\n[color=red]Reminder: If the file has any sort of security mesure added you can decrypt it by typing &quot;[/color][color=orange]decrypt[/color][color=red]&quot; followed by the name of the file [/color]\r\n',NULL,1,0,0,0),(96,24,'connect',92,'','IP_1:89',0,0,0,1),(97,24,'cat',95,'','file4640259',0,0,0,1),(99,24,'connect',93,'','IP_2:3123',0,0,0,1),(104,22,'decrypt_file',89,'','backup.sql',0,0,0,1),(105,25,'ping',NULL,'[i]A girl slowly approached me. She doesn’t look older than I am. I can’t feel the black floor keeping us from falling and when I glanced around I saw nothing, only darkness. \r\n\r\nHer hair was waist-long white and her eyes pale blue. She wore a nightgown as black as the darkness around us and was barefooted. I stared into those soulless eyes and it felt weird but, at the same time, right. An eternity later her lips parted and Emilia’s crystal clear voice engineered to the last sound to be nothing less than perfect whispered.\r\n\r\n“This is the path you have chosen”\r\n\r\nWhen I tried to question, I found myself unable to make any sound or even move my feet from the floor they seemed glued to.\r\n\r\n“It’s not going to be easy, it never is. But you will go on, for the sake of us all. Every step you’ll make will be towards fame and power, towards an unavoidable destiny”\r\n\r\nIronically, right there and then, I couldn’t have put one foot in front of the other, even if they wouldn’t have been firmly stuck to the floor.\r\n\r\n“And so the endless cycle will complete itself once more”\r\n\r\nThe voice turned into a distant echo and faded away, but her words lingered inside of my mind, forever.[/i]\r\n\r\nWhen I opened my eyes, I found myself staring into my room’s ceiling. The same dream.. again. Those pills didn’t help a bit now did they?\r\n\r\nI make my way out of the bed and to my desk next to the glass wall offering an outstanding view of our what we like to call state of the art city.\r\n\r\n“Another day in paradise..”\r\n\r\nI decide to check my emails in an attempt to take my mind off these messed up dreams I’ve been having lately. All the stress couldn’t have helped either, right?\r\n\r\nI read of the address of my private mail server from the glassy surface of the desk.\r\n\r\nIP_1\r\n\r\nI think I remember running the server on the default email secure port 465.',NULL,1,0,0,0),(106,25,'connect',105,'','IP_1:465',0,0,0,1),(107,25,'ping',NULL,'Hmmm.. there’s something weird in the log data. As if someone has tampered with it, but if that’s the case that person is too good, way to good.\r\n\r\nWhat\'s with this email? The Omega\'s? They finally got back to me...\r\n\r\nThey want me to what?!',NULL,2,0,0,0),(108,25,'read_email',107,'','2|IP_1:465',0,0,0,1),(109,25,'ping',NULL,'Some kind of test. I can\'t say I didn\'t see this one coming.\r\n\r\nLooks like it\'s hacking time. What better way to start the day?',NULL,3,0,0,0),(110,25,'connect',109,'','IP_2:42',0,0,0,1),(111,25,'ping',NULL,'Looks like this is the right port.\r\n\r\nI\'ll just stick my nose around a bit. No harm intended, of course.\r\n\r\nHmm.... what do we have here?',NULL,4,0,0,0),(112,25,'connect',111,'','IP_4:24',0,0,0,1),(113,25,'ping',NULL,'This seems to be one of their private servers. They\'re usually nearly impossible to find.\r\n\r\nThere\'s a file with my name on it... I sure hope it\'s not another challenge.',NULL,5,0,0,0),(114,25,'delete_file',113,'','USERNAME.readme',0,0,0,1),(116,24,'ping',NULL,'All traces have been deleted. \r\nThis server... It makes me feel... exposed.\r\n\r\n[color=red] Reminder: Use the &quot;[/color][color=orange]get[/color][color=red]&quot; command to return the list of e-mails.\r\n\r\nReminder: Use the &quot;[/color][color=orange]read[/color][color=red]&quot; command followed by the number of the e-mail in order to read it.\r\n[/color]',NULL,3,60,0,0),(117,24,'read_email',116,'','0|IP_2:3123',0,0,0,1),(118,24,'ping',NULL,'This is... rather unpleasant...\r\n\r\nEven though all data has been deleted, this e-mail remains... We should be able to analyze it... with some help.\r\n\r\nI\'ve contacted an Alpha team. They requested to forward the e-mail to this adress:\r\n\r\ntma19275@a.com\r\n\r\nYou should logout once you forward the e-mail... I don\'t like this place...\r\n\r\n[color=red] Reminder: To forward and e-mail use the &quot;[/color][color=orange]forward[/color][color=red]&quot; command followed by the number of the e-mail and the adress you want to send it to.\r\n[/color]',NULL,4,0,0,0),(119,24,'forward_email',118,'','0|tma19275@a.com|IP_2:3123',0,0,0,1),(121,26,'ping',NULL,'This time, we\'ll have to be quick. We just got an e-mail from a corrupted source. \r\n\r\nIf you don\'t remember it, your  [color=orange]SMTP[/color] service port is 974.\r\n\r\n[color=red]Reminder: Check the Discovered Hosts tab on the right to view the hosts you have acces to.[/color]\r\n',NULL,1,0,0,0),(122,26,'connect',121,'','IP_1:974',0,0,0,1),(123,26,'ping',NULL,'Huh?\r\nThere are two now... \r\n\r\nEither way, check the 4th first.\r\n\r\n[color=red] Reminder: Use the &quot;[/color][color=orange]get[/color][color=red]&quot; command to return the list of e-mails.\r\n\r\nReminder: Use the &quot;[/color][color=orange]read[/color][color=red]&quot; command followed by the number of the e-mail in order to read it.\r\n[/color]',NULL,2,30,0,0),(124,26,'read_email',123,'','3|IP_1:974',0,0,0,1),(125,26,'ping',NULL,'I don\'t have enough time to trace the ID before he gets away!\r\n\r\nYou can check the other e-mail now... \r\nWe won\'t be able to catch him anyway.',NULL,3,30,0,0),(126,26,'read_email',125,'','4|IP_1:974',0,0,0,1),(127,26,'ping',NULL,'This man is a hacker, just like you! He must have noticed some anomalies earlier and traced him down!\r\n\r\nThat adress... it\'s an Alpha Terminal! He\'s bouncing!\r\nWe are not supposed to access one, not at this level anyway, but... If I overwrite my settings...\r\n\r\nDone!\r\n\r\nI managed to open a single port: 3675. It\'s an [color=orange]SSH[/color] server.',NULL,4,60,0,0),(128,26,'connect',127,'','IP_2:3675',0,0,0,1),(129,26,'ping',NULL,'He left in a hurry... The logs are still intact.\r\n\r\nThe next sever on his bouncing list is... a bakery\'s [color=orange]SSH[/color] server?\r\nI won\'t judge...\r\n\r\nIP: IP_3\r\nPort: 7923',NULL,5,0,0,0),(130,26,'connect',129,'','IP_3:7923',0,0,0,1),(131,26,'ping',NULL,'An [color=orange]SSH[/color] Alpha Server next? \r\nThis guy is on a roll.\r\n\r\nIP: IP_4\r\nPort: 941',NULL,6,60,0,0),(132,26,'connect',131,'','IP_4:941',0,0,0,1),(133,26,'ping',NULL,'Huh? He managed to compromize an Alpha server this badly?\r\n\r\nI don\'t like where this is going, but I can\'t treace him anymore. He must have removed all his servers from the bounce list.\r\n\r\nThe damage done here is extensive... but... that file... open it.',NULL,7,0,0,0),(134,26,'cat',133,'','Quiiiiiiiiiiiiiiiz_Timeeeeeeeeeeeeee!',0,0,0,1),(135,26,'ping',NULL,'He is playing with us.\r\n\r\nFind out what he is talking about!\r\n\r\n[color=red]Reminder: You can see you previous comands by pressing the up arrow key.[/color]\r\n',NULL,8,180,0,0),(136,26,'connect',135,'','IP_5:14',0,0,0,1),(137,26,'ping',NULL,'He... the Alpha-Killers... I don\'t know what it means...\r\n\r\nI have nothing on my database about such an organization...\r\n\r\nInspect that file.',NULL,9,60,0,0),(138,26,'cat',137,'','The_Alpha-Killers',0,0,0,1),(139,26,'ping',NULL,'&quot;You have no ideea what you are getting into&quot;, huh?\r\n\r\nWe shouldn\'t stick our noses any further than this.\r\n\r\nLogout from the server and be done with it.',NULL,10,0,0,0),(140,29,'ping',NULL,'[i]Having said that, Alpha Day hit the humankind as a forced wake up call. \r\n\r\nAt exactly 01:00 AM, standard time, the third planet from the Sun went silent. Suddenly the Terra looked as if devoid of technologically advanced life. Every piece of tech ceased to function. Satellites surveyed the dark side of the planet, helplessly witnessing the lights going off one by one as if an electromagnetic pulse was propagating on a planetary scale. Communications, weaponry, electricity, transports, planes, ships, hospitals, all gone in the short blink of an eye [...][/i]\r\n\r\nI stop next to the girl who up till then was relating  not long past events to the kids who have gathered around her, willing to listen.\r\n\r\n[b]You\'re still telling that story?[/b], I ask.\r\n\r\n[b]What do you mean \'still\'? It\'s our history[/b]\r\n\r\n[b]It\'s depressing[/b]\r\n\r\n[b]Just real[/b]\r\n\r\n[b]Could I steal you for a second? We need to talk... in.... private[/b]\r\n\r\nShe stands up with a sigh and follows me outside of the underground pub. \r\n\r\n[b]So what\'s so important that you couldn\'t let me depress those kids to boredom?[/b]\r\n\r\n[b]I\'ve received this email a few minutes ago. I think you might want to take a peak. I\'ll forward it to you, what\'s your local ID?[/b]\r\n\r\n[b][i]chloe@omega1406.temp[/i][/b]\r\n\r\nI take out my Glass Mobile Device and once my terminal popped up I began forwarding her the email from my private server IP_1:23.\r\n',NULL,1,0,0,0),(141,29,'ping',NULL,'[b]You\'re kidding right, USERNAME?[/b]\r\n\r\n[b]Looks legit, I\'m pretty sure it was sent on the official channel.[/b]\r\n\r\n[b]So you\'re actually going up there. You\'ll have some pretty great opportunities to... poke around.[/b]\r\n\r\n[i]Going into Iris. Almost seems surreal really.[/i]\r\n\r\n[i]Iris is meant to be the proverbial eye in the sky. Constructed with state of the art technology, its computational power is driven entirely on quantum computers. The processing speed of data driven out of these computers was far superior to the ones used before World War III. The entire ship became Alpha’s main research centre. The material used to manufacture the structure for Iris is called graphene, another research field Alpha had taken upon themselves to bring to its full potential after the war. Graphene is, more or less, an atom thin layer of graphite, a 2-dimensional highly durable material with countless properties, making it most suitable choice for the orbital station. Due to graphene’s complex attributes, the entire body of Iris was a solar panel in itself, thinner than a piece of paper and stronger than any other known-to-human material. \r\n\r\nNot to mention the entire thing is as light as a feather. Capable of sustaining over thirteen research laboratories on Earth’s low orbit, completely controlled by Emilia and its own inner grid, Iris is nothing less than the technological peak of Alpha’s efforts. The station uses literally close to no energy what-so-ever, is self-driven and self-maintenanced. There’s no public information regarding on exactly what kind of experiments are taking place inside the station or what defensive and offensive capabilities Iris has, but one would be blind to take any of them lightly. Iris was pretty imposing at first and even second sight, looking as if had just been pulled out of a science fiction movie, gracefully circling our planet. Naturally, some believed it was yet another mean of grasping the control they had over the world even tighter in their strong fist. Rumours Alpha was planning to built another station on orbit of Mars and even colonise the red planet for its natural resources were not uncommon.\r\n\r\nA few years ago Iris’s assembly procedure on Earth’s orbit began. It took the corporation two years to complete it. Piece by piece, hundreds of rocket launches had taken place to bring all the necessary modules Iris was made out of into the vastness of space. The station went online without any major technical difficulties on the 14th of December, 2050, and, since then, has greatly been speeding up their researches.\r\n\r\nNot many civilians, if any, ever got the one in a lifetime chance to cast an eye inside Alpha’s masterpiece. Every year, twenty two students, one from each zone, were picked, embarked on a spacecraft made from the same futuristic designs and launched into outer space, on a collision trajectory with Iris. Obviously, only less important areas are shown to them, in a guided tour lead by one of Alpha’s top researchers. After all, even they had to recruit bright young minds to keep on working on what they’ve started. When the couple of hours the tour needed to complete had passed, the group of students is brought back on Earth, usually with an offer to join one of the research groups, depending on their domain of expertise and interests.\r\n\r\n[b]And I? I am going into the Iris.[/b]\r\n[/i]\r\n\r\nSeeing I\'ll need to get my hands on as much information as possible while up there, I decide on investigating the Iris, perhaps finding some Security Access Codes to allow me to move more freely once I\'m inside their local system. We have been unable to penetrate their shields from the outside by no means. We believe they don\'t even connect to Earth\'s network except for two random times per day and their security protocols are just... off the charts.\r\n\r\nWe\'ve recently found a couple of Grid Nodes on our scans. These nodes seem to be somehow related to Iris and might contain useful data.\r\n\r\nI think I might just have a look. I remember storing a list of IP\'s on my secure storage server IP_2:465.\r\n\r\nI\'d better take a look as soon as possible. I simply cannot afford losing any more time.\r\n',NULL,2,0,0,0),(142,29,'forward_email',140,'','0|chloe@omega1406.temp|IP_1:23',0,0,0,1),(143,30,'ping',NULL,'',NULL,1,NULL,NULL,0),(144,29,'connect',141,'','IP_2:465',0,0,0,1),(145,29,'ping',NULL,'Looks like a handful. I\'ll have to go through each and everyone of those and transfer all the files I find to my server IP_2:465.\r\n\r\nI really hope there\'s something on at least some of these nodes.',NULL,3,0,0,0),(146,29,'transfer',145,'','iris.security.certificate|IP_2:465',0,0,0,1),(147,29,'transfer',145,'','access.codes.iris|IP_2:465',0,0,0,1),(148,29,'crack',145,'','IP_5:286',0,0,0,1),(151,29,'ping',NULL,'That seems to be all.\r\n\r\nI\'ll just connect back to my email server to confirm my attendance.\r\n\r\nIP_1:23\r\n\r\nI hope I won\'t throw up during take off..',NULL,4,0,0,0),(152,29,'connect',151,'','IP_1:23',0,0,0,1),(153,32,'ping',NULL,'The next five days passed in a blur. In the blink of an eye I was dressed in a light spacesuit and watching the other passengers occupying their seats in the shuttle, readying themselves for take-off towards the Iris.\r\n\r\nA huge digital wall, which I believe must somehow be protected against the launch vibrations, was positioned a small distance from the front row. Five minutes before lift-off, the lights dimmed and the same man that announced the Alpha Treaty Conference all those years back stood in front of us. He hadn’t changed a bit from the materials I studied in the library.\r\n\r\nHe looked around, as if bodily present, eyeing each and everyone of us and then calmly spoke.\r\n\r\n“Welcome. You alone have been chosen among few others to represent your Zones. Students have been hand-picked and filtered, automatically and manually, and you… you stood out, because you are at the top of the game. An offer to join one or more research groups will be delivered to you as soon as your visit is over. They say eyes are the gateway to the human soul. If so, you’re going to take a peek through the keyhole. Alpha would like to wish you a pleasant trip into the Iris. Departure in T minus 5, 4, 3, 2, 1”\r\n\r\nI could hear some of the students screaming as we burst through the sound barrier and soon enough gravity was no more. The screen now displayed the front view of the shuttle, as we got closer and closer to the stations. I felt as on a whole new level of Alpha was being revealed to me as I saw the space-station getting bigger and bigger. The planet also came into view as we began docking procedures.\r\n\r\nDocking in progress. Please stay seated. Be careful while entering the station, artificial gravity field is active.\r\n\r\nEmilia’s familiar voice spoke and the screen turned off suddenly, the lights coming back on.\r\n\r\n“Ladies and gentlemen, welcome to Iris. This is your captain, we will begin deboarding the craft in a few minutes. Please make sure you won’t leave anything behind”\r\n\r\nI can feel the electric excitement in the air. All of them are eager to go and are talking passionately about what might be waiting for us. I’m excited nonetheless, but perhaps for other reasons. I don’t want to see only what they want us to see. I don’t have any plan. However, hopefully, through improvisation I’ll be able to slip by our guard and have a look around and find some more information about Alpha. This place must be filled with their secrets. The internal self-sustaining grid connects to Earth only twice a day, at random times, and with heavy usage of quantum cryptography to shield the data stream. In those few seconds that the transfer lasts, enough data to take one human a couple lifetimes to study is passed through.\r\n\r\n“If you’ll follow me, please. The lab ahead is where we operate our genetic research”\r\n\r\nThe type of discoveries in that department were considered even more controversial than the others. Alpha’s ethics were highly debatable at best. For example, cloning was something they were willing to experiment with with, even where humans were concerned. Playing god has never caused any real ethical breach, it was even encouraged to try and bend the laws of nature to ones will. This entire Iris project promoted that vision.\r\n\r\nI looked around the futuristic corridor leading to the BioSpace Research laboratory, my peers far ahead, following the Alpha representative like mere sheep. I moved my hand to the motion sensor of the bathroom door, hoping they won’t start a general search when they realize I\'ve been left behind. I washed my face with cold water and sneaked a look at myself mirror self, reminescenting the odd series of events that had taken me up here.\r\n\r\nThe bathroom door closed shut with a slight thud. I noticed my group was nowhere to be seen. Curiosity and impatience are not a good combination, I soon learned.\r\n\r\nUnable to just stay put and wait for them, she turned right at the first opportunity and kept on walking through a surprisingly long corridor. The walls resembled huge screens, an endless stream of data flowing endlessly across the graphene surface.\r\n\r\nI soon came across a closed glass door just as wide as the entire corridor. A glass panel waited expectantly on the wall to my left. And my vision to the beyond was blurred out my the texture of the glass wall.\r\n\r\nI connect my Portable Glass Device into the panel and think about my course of action.\r\n\r\nI located the IP of the local master security server, IP_1.\r\n\r\nMy theory is that I need find my way in and transfer a copy of the security certificate I have compiled, from my local storage to the slave servers I should be able to gain the addresses of once I control the master.\r\n\r\nTo copy the certificate from a server to another I can use [b]scp filename IP port[/b].\r\n\r\nI must make sure I delete logs behind me to keep them from tracing me. Even on servers I connect only to SQL, I\'ll have to check for an SSH port to execute [b]rm logs[/b] on when I\'m done with it.\r\n\r\nFingers crossed.',NULL,1,0,0,0),(154,33,'ping',NULL,'*HEAVY COUGH*\r\n\r\nWelcome to [b]Alpha\'s Computer Science Qualification Crash-Course[/b]. Designated course code COMP101.\r\n\r\nMy name is Alex and I\'ll be your instructor for the day.\r\n\r\nThe school has asked me to give you a lesson on how to manage files on the Cardinal OS so let\'s not waste any more valuable time and get right to it, shall we now?\r\n\r\nYou bunch don\'t look to enthusiast but that\'s none of my concern so please focus on the console interface.\r\n\r\nThe [b]console[/b] allows you to interact directly with the Cardinal Operating System running on your machine or other servers.\r\n\r\nIt should be familiar to those who dealt with one flavour or another of UNIX, a system used before the last war.\r\n\r\nYou\'re currently logged in your school account and we\'ve pushed a couple of files for you to play with during our session together.\r\n\r\n[b]Fair warning [i]Trying to skip ahead or playing around unattended might ruin the lesson for you completely and we\'ll have to start over. I will not be pleased if something like that were to happen[/i].[/b]\r\n\r\nThe command you will most likely find yourself using all the time is [b]/help[/b]. Try it now and see what it does. Also give a try to the [b]man[/b] as explained when you view the output of [b]/help[/b].\r\n\r\n*HEAVY COUGH*\r\n\r\nFor starters, please note the list of DISCOVERED HOSTS. The first few will be the servers you own. Note the hostname is the one set in the Servers Interface. The first one is the main server you have set in the Servers Interface, the server you are connected to by default. The one to which you find yourself on whenever you logout from any other host. You cannot connect to that main server since that is the server you connect from to any other server.\r\n\r\n\r\nMost basic of commands you should know of is [b]ls[/b].\r\n\r\nThe [b]LS (ls)[/b] command will provide you with a [u]list of available files[/u] on the server you are connected to. [b]ls[/b] has some other tricks under its sleeve but we\'re not going to talk about them. However, we\'re more than curious if you can discover them for yourselves.\r\n\r\nBack on track, I hope you\'ve already tried the command and discovered it does exactly what you\'d expect.\r\n\r\n[b]Another useful piece of magic is pressing the Up and Down arrows. They allow you to navigate through a short history of commands you have entered in the console.[/b]\r\n\r\nGive a try to the first command you\'ve seen presented by [b]/help[/b], the [b]ifconfig[/b] instruction. \r\n\r\nThis command shows basic info about the host you are currently connected 2. If you are not connected to any host it will show the info of your main server in the mission. You will find yourself using it for example when you need to transfer files to your main computer and you need to know its IP and this is one of the only ways to find it out. Or at times you might need to find other details like the version of the Operating System running on a computer.\r\n\r\nYou must know that when you start you\'re always connected to your main computer which always runs an SSH service on port 22. You might want to make a habit out of always using [b]ifconfig[/b] to take note of your main computer\'s IP before moving on to any other tasks.\r\n\r\nThere are 3 files present. Your first task is to delete the first file.\r\n\r\nThe command required to do just that is \r\n[b]rm filename[/b]',NULL,1,0,0,0),(158,33,'delete_file',154,'','task1.txt',0,0,0,1),(159,33,'ping',NULL,'Good stuff, newbies.\r\n\r\nNext thing on the list is [i]reading a file contents[/i].\r\n\r\nYou can obviously only view the contents of files that are not encrypted and are not executables. If you attempt to read such files you\'ll most likely end up with a chunk of non-human-readable text filling up your screen.\r\n\r\nOur command of choice for that sort of thing is [b]cat filename[/b].\r\n\r\nWhy the name? Maybe the creator liked kitties?\r\n\r\nMoving on. Your second task is to read the contents of [i]task2.txt[/i] using [b]cat[/b] and follow the instructions I\'ve provided inside.\r\n\r\nThink you can handle that?',NULL,2,0,0,0),(160,33,'cat',159,'','task2.txt',0,0,0,1),(162,33,'decrypt_file',159,'','task3.txt',0,0,0,1),(163,33,'kill_file',159,'','task4.runme|IP_0:22',0,0,0,1),(164,34,'ping',NULL,'My name is Crow.\r\n\r\nMy course is simple and I always start off with a true story:\r\n\r\n[i]A crow was sitting on a tree, doing nothing all day. A small rabbit saw the crow, and asked him:\r\n\r\n\"Can I also sit like you and do nothing all day long?\" \r\n\r\nThe crow answered: \r\n\"Sure, why not.\" \r\n\r\nSo, the rabbit sat on the ground below the crow, and rested. \r\n\r\nAll of a sudden, a fox appeared, jumped on the rabbit and ate it.[/i]\r\n\r\nMoral of the story?\r\n\r\nTo be sitting and doing nothing, you must be sitting very, very high up. Now, let\'s see if you\'re today\'s rabbit.\r\n\r\nIn the Cardinal OS architecture, SMTP servers handle emails: sending, receiving and storing. SMTP originally means \"Simple Mail Transfer Protocol\", but now it can be used to store emails as well, handling virtually all aspects of email services.\r\n\r\nOnce connected to a SMTP server you can send emails or play around with the stored emails without needing other protocols. \r\n\r\nI\'ve set up a small and protected email server for you to hack and play with.\r\n\r\nHost: IP_1\r\n\r\nIt\'s running on the default SMTP port. If you don\'t know which that is, you\'ll have to scan for open ports then make your way into the system (have you forgotten the scan command already? Try [b]/help[/b], in case you did. You might want to note these down).\r\n\r\nI\'ll provide you with more details at the right time.\r\n\r\nTo connect to a SMTP server you use the following command:\r\n[b]smtp ip port[/b]',NULL,1,0,0,0),(165,34,'connect',164,'','IP_1:25',0,0,0,1),(166,35,'ping',NULL,'My name is Not Important, but you can call me Nort. What matters is that I\'ll be your instructor for the next few minutes.. so you\'d better listen carefully. \r\n\r\nAre you thinking \"or what?\" right now? Well, when you need this knowledge in a life or death situation don\'t come back crying to me.\r\n\r\nYou\'d better wipe those smirks off your faces and erase that all-knowing look from your eyes and we\'ll get along just fine.\r\n\r\nSSH comes from Secure Shell and is a cryptographic network protocol for secure data communication, remote command-line login, remote command execution, and other secure network services between two networked computers. It connects, via a secure channel over an insecure network, a server and a client running SSH server and SSH client programs, respectively.\r\n\r\nTo put it simply: it allows you to connect to another compute and execute commands on it, for example, to manipulate files.\r\n\r\nThe Cardinal Operating System, most if not all computers in the world run right now, has both an SSH server and client by default.\r\n\r\nBefore we move forward, let\'s explore some useful commands.\r\n\r\nTry [b]ifconfig[/b] - Shows data about current host (IP, MAC address, port). We\'ve already seen it in account earlier.\r\n\r\nThe IP is what identifies a computer on the Grid. It\'s, in lack of better terms, the address or location of a server but it doesn\'t necessarily make reference to the physical location of the machine.\r\n\r\n[b]ping ip[/b] - Confirms that the host exists and is online. If found, the host is added to your known hosts list.\r\n\r\n[b]nmap ip[/b] - Shows a list of services and the ports they are running on.\r\n\r\nAnd our desired command for the day\r\n[b]ssh ip port[/b]\r\n\r\nThe first server I want you rookies to connect via SSH to is IP_1. The SSH service is running on the default port. \r\n\r\nI am not, however, going to tell you which that port is. If you know it already, brilliant. Otherwise, call [b]nmap[/b] on IP_1 to see which ports have running services on them and then connect to the SSH service using the [b]ssh[/b] command mentioned above.\r\n\r\nYou next task awaits after you\'ve successfully connected to IP_1\'s SSH server.',NULL,1,0,0,0),(167,35,'connect',166,'','IP_1:22',0,0,0,1),(168,35,'ping',NULL,'Hmm.. interesting. I didn\'t expect you especially to understand this stuff.\r\n\r\nOh well.. let\'s wait for your colleagues to catch up and then we\'ll continue.\r\n\r\nOk, then. Time to move forward.\r\n\r\nSome servers have extra protection on ports to protect the services they host.\r\n\r\nWe have to break through the encryption in order to access the services.\r\n\r\nIP_2 has a protected SSH server running on port 22.\r\n\r\nThe following command allows you to hack the encryption:\r\n\r\n[b]crack IP port[/b]\r\n\r\nWhat are you waiting for? Give it a try, my hair is going white!\r\n\r\n[i]It\'s already white.[/i]\r\n\r\nOhh.. and to log out of a host you must enter\r\n[b]logout[/b] \r\n\r\nPretty damn complicated, right?',NULL,2,0,0,0),(169,35,'crack',168,'','IP_2:22',0,0,0,1),(170,35,'ping',NULL,'The encryption should be out of the way. Confirm your success by connecting to IP_2:22.\r\n\r\nWith this we\'ll conclude our lesson.\r\n\r\nIt\'s been not such a big pleasure meeting you.\r\n\r\nBye cookies.. I meant rookies, my sweet apologies.',NULL,3,0,0,0),(171,35,'connect',170,'','IP_2:22',0,0,0,1),(172,35,'ping',NULL,'Did you REALLY think I\'ll let you off the hook so easily?\r\n\r\nI mean.. seriously?! hahahahahha!\r\n\r\nEvery year rookies... every single year.\r\n\r\nThere\'s one more thing I want to show you. Call it.. a bonus.\r\n\r\nOn IP_2:22 is a file, as you SHOULD\'VE noticed.\r\n\r\nA special command on the Cardinal OS allows you to transfer files from one host\'s SSH service to another. Well.. the files must not be encrypted or running when the command is executed, but otherwise it\'ll do the job.\r\n\r\nTo transfer a file we write:\r\n\r\n[b]transfer filename target_ip target_port[/b]\r\n\r\nWhere the IP and port are the destination. The destination must be a service of the same kind, SSH.\r\n\r\nIf you\'d like to finally get rid of me, [b]please transfer file.transferme from IP_2 to IP_1[/b].\r\n\r\nWe also can take advantage of the [b]scp[/b] command which works the same way just that instead of transferring it will create a copy of the file on the designated target. Use [b]/help and man[/b] for more info.\r\n\r\nAllons-y!',NULL,4,0,0,0),(173,35,'transfer',172,'','file.transferme|IP_1:22',0,0,0,1),(174,34,'ping',NULL,'You\'re now connected to my test SMTP server.\r\n\r\nLet\'s see what tools we have at our disposal.\r\n\r\nFirstly, [b]get[/b].\r\n\r\nPlain and simply. It returns a list of available emails, stored in the server database.\r\n\r\nThere are two emails.\r\n\r\nTo read one of them we write\r\n\r\n[b]read ID[/b]\r\n\r\nWhere the ID is the number presented in front of each email.\r\n\r\nWe shall move forward as soon as you\'ve read the contents of both emails.',NULL,2,0,0,0),(175,34,'read_email',174,'','0|IP_1:25',0,0,0,1),(176,34,'delete_email',174,'','1|IP_1:25',0,0,0,1),(178,34,'ping',NULL,'Forward.\r\n\r\nI mean literally, forward!\r\n\r\nForwarding an email can be very useful at times. For example if you want a copy of it on your email server or if you want to send it to third-parties.\r\n\r\nThe all-mighty command for doing such is\r\n\r\n[b]forward ID email[/b]\r\n\r\nOne neat trick is to forward an email to yourself!\r\n\r\n[b]forward ID username@secretrepublic.net[/b]\r\n\r\nYou\'ll receive a copy for safe keeping outside of the mission.\r\n\r\nPlease forward the remaining email to me at instructor@cs.alpha.zone to wrap this up.',NULL,3,0,0,0),(179,34,'forward_email',178,'','0|instructor@cs.alpha.zone|IP_1:25',0,0,0,1),(180,36,'ping',NULL,'[i]So USERNAME, you\'re our new agent huh? \r\n\r\nI never heard of you before. I should have gone with ProblemChild or Disposable Unit for this mission, but they had more important things to do.\r\n\r\nSo you will be assigned on low priority missions.Yes...get used to that definition...[b]LOW..PRIORITY[/b].\r\n\r\n*sigh* Anyway here goes nothing. Last night around 5:05 our internal server got hacked.\r\n\r\nAll the files inside were deleted. But since we were going to get rid of that server anyway, it contained nothing more then some old government manuals and foreign country spy reports.\r\n\r\nHalf of those countries don\'t even exist anymore..good luck finding all those Islands on the map now that half of the Earth is flooded.\r\n\r\nAnyway, even though we can\'t care less about some outdated files which got erased, we were going to do it anyway, we still got our pride!\r\nIt\'s up to you to catch him and to deliver him a nasty surprise once found...that is..IF you can find him.\r\n...\r\nWhich I doubt.\r\n...\r\nYou might as well resign now!\r\n...\r\nStill here?\r\n...\r\n*sigh*\r\n...\r\nThe job explanation can be found in your email inbox.\r\nJust make sure you don\'t mess up on the first assignment, because if you will it will also be your last![/i]\r\n\r\n\r\n[b]He\'s daring me. I like it. Might just be fun. I\'m going to check my mail server.[/b]',NULL,1,0,0,0),(181,37,'ping',NULL,'I was worked for Blune Inc. as a programmer. I had a colleague called Jeff. He was a good programmer. But he made a mistake. He wanted to make money, but in a bad way. He was built a backdoor to an Anti-virus program, to steal the users datas. He wasnt very careful. A tester found his backdoor. Jeff and I were fired. They thought i was in that bullshit, too. I stayed here, tried to find another job, and Jeff left Chicago. I was mad at him! I lost my job, because of him!\r\nThis was 3 years ago. Since that, i never heard about Jeff again...\r\n\r\nPresent:\r\nI\'m working on an algorythm, when someone knocks on my door. I open the door, then... I was shocked. It was Jeff. I just want to shut the door, but he stopped me.\r\n[b]-I know what you think. But let me talk first.[/b]\r\n[b]-3 years ago you ruined my life! It took me 2 years to climb back from the sh*t hole![/b]\r\n[b]-Listen! I have a job for you! You can earn a lot of money.[/b]\r\nI should hear him out. But no. I don\'t care.\r\n[b]-Just go away, or I will call the police![/b]\r\n[b]-Okay, the i will send you a message then. It will contains every info you need. If you change your mind.[/b]\r\nMaybe i will read that message. My ip is IP_1 and my SMTP port is 22',NULL,1,0,0,0),(182,38,'ping',NULL,'We have four servers for you.\r\n\r\nEach server contains only one file.\r\n\r\nEach file has a part of an IP.\r\n\r\nYour final task is to hack and connect to that ultimate IP.',NULL,1,0,0,0),(183,39,'ping',NULL,'We started with about one hundred and fifty of you in this course?\r\n\r\nNow there\'s about what.. seven?\r\n\r\nLooks like even in these troubled times, when these skills are of utmost importance, only so many people are aware of what\'s ahead the road.\r\n\r\nIn any case, we have a few more lectures to attend to before we can call it a wrap for the Alpha Computer Science Crash-Course.\r\n\r\nOne simple word describing the most complex of simple matters: [b]DATABASE[/b].\r\n\r\nDatabases store data, information, in a structured way. Usually in such a way that is easily searchable, indexable. They are used for storing all kinds of data from words to images, from credit cards to DNA sequences, from you to me.\r\n\r\nLooks like the tech team has finished preparing our test SQL Database server.\r\n\r\nYou can connect to an SQL server using the following command\r\n\r\n[b]sql host_ip host_port[/b]\r\n\r\nSimilarly to how you connect to an SSH or SMTP service.\r\n\r\nEveryone connect to IP_1 on port 1433.',NULL,1,0,0,0),(184,39,'ping',NULL,'Alrighty then. \r\n\r\nFirst but not least we want to see all available data in the database so we know what we are dealing with here.\r\n\r\nFor files we use [b]ls[/b]. For databases we need to execute a [i]query[/i].\r\n\r\nThat\'s an instruction sent to the database server which processes it and returns a result.\r\n\r\nNow that we are connected to the server, we can send queries and the output will be revealed to us.\r\n\r\nSending the following query will return a list of available [b]tables[/b] which are in a way the base unit databases are split into.\r\n\r\n[b]show tables[/b]\r\n\r\nThere\'s only on table here and it\'s called [i]users[/i].\r\n\r\nNow let\'s select all the data from inside the [i]users[/i] table.\r\n\r\n[b]select * from users;[/b]\r\n\r\nThis will return all the rows (in this case accounts) in the [i]users[/i] table.\r\n\r\nThis isn\'t very tricky I hope but it might need some getting used to. Luckily you can redo any step of this course whenever you feel like you need a refresher. And again the [b]/help[/b] command is vital anytime you feel lost.\r\n\r\nTo delete a record we use\r\n\r\n[b]delete from TABLE where COLUMN = \"VALUE\";[/b]\r\n\r\nFor example to delete the account Claw we can execute\r\n\r\n[b]delete from users where name = \"claw\";[/b]\r\n\r\nThe command will erase her row from the table.\r\n\r\nYour most final task is to eliminate Razor from the [i]users[/i] table, following the Claw example.',NULL,2,0,0,0),(187,39,'connect',183,'','IP_1:1433',0,0,0,1),(188,39,'sql_delete',184,'','users|1|IP_1:1433',0,0,0,1),(189,40,'ping',NULL,'I received a somewhat of an interesting email last night.\r\n\r\nI haven\'t paid too much attention to it but after a good night sleep I think it might be worth reading one more time.\r\n\r\nIf I recall correctly, I saved it on IP_1. The email server should be on port 325. It hosts one of my personal addresses, USERNAME@secretrepublic.net\r\n\r\nI\'ll go and take a another look.',NULL,1,0,0,0),(190,40,'ping',NULL,'I remember reading about the Cobra\'s. They\'re some elite agency used by rich corporations in their schemes to take down competition and for state of the art corporate espionage.\r\n\r\nI\'ve never heard of them recruiting people lacking experience as much as me.. but you never hear from actual individuals who work for them... only rumours.\r\n\r\nI guess I have nothing to lose when I think about it so the hell with it.\r\n\r\nIt\'s time to taste the venom of a cobra.',NULL,2,0,0,0),(191,40,'connect',189,'','IP_1:325',0,0,0,1),(192,40,'forward_email',190,'','0|USERNAME@secretrepublic.net|IP_1:325',0,0,0,1),(193,40,'ping',NULL,'What is this?\r\n\r\nAs soon as I forwarded the email my Glass Device blinked. I got a message from the operating system itself. These guys are good, no kidding.\r\n\r\n[i]\r\nWe are very glad indeed to have you on our team. We\'ll start you off with an easy task we need completed right away for a valuable client.\r\n\r\nYour orders are to make your way into the following server\'s SSH service and delete all the files you find in there in order to disable the companies website for the time being. We have no information as to the port the service is running on.\r\n\r\nIP_2\r\n[/i]',NULL,3,0,0,0),(194,40,'connect',193,'','IP_2:24',0,0,0,1),(195,40,'ping',NULL,'Looks like the file is here. \r\n\r\nBio-keltech? \r\n\r\nThey\'re some sort of new company with big breakthroughs that I heard is recruiting many biotech graduates recently help out with their big deal research stuff.\r\n\r\nI\'ll just delete the file and then log back in to my email server and wait for further instructions I guess.\r\n\r\nHave I just made a pact with the devil?',NULL,4,0,0,0),(196,40,'delete_file',195,'','index.html',0,0,0,1),(197,40,'connect',195,'','IP_1:325',0,0,0,1),(198,36,'connect',180,'','IP_2:80',0,0,0,1),(199,36,'ping',NULL,'Good you\'re here, now get to work USERNAME!',NULL,2,0,0,0),(200,36,'cat',199,'','connection.logs',0,0,0,1),(201,36,'ping',NULL,'These are all the connections and logouts that were made that day.\r\nThis is where the bounce route ended it seems.\r\nStrange....\r\nOh wait, I see what he did there.\r\nYou probably dont.\r\nShould I call someone else to do the job? \r\nI got ProblemChild on speed dial you know. hahaha',NULL,3,0,0,0),(202,36,'ping',NULL,'I cant believe it! You actually found the source of the attack.\r\nAll of our old files are there and this is the end of the line so this has got to be the hacker who\'s responsible.\r\nDid you figured out that he used a log deleter and log editor to alter the connections.log or did you asked a friend to help you with that?\r\n\r\n\r\nI see that he has a executable virus program on his computer, the same one he tried to use on our server.\r\nThe virus failed to upload properly on our server but maybe you could be more successfull by using his own weapon against him.\r\n\r\nLet Mr. Bozo get a taste of his own medicine, good luck USERNAME.',NULL,4,0,0,0),(203,36,'connect',201,'','IP_13:233',0,0,0,1),(206,41,'ping',NULL,'Hello, USERNAME.\r\nI have an offer to make to you, one that I\'m sure you will like. If you accept, you\'ll need to delve into this mail server I\'ve discovered.\r\n\r\nIP_1:22 \r\n\r\nOnce you\'re in, I\'ll contact you with more information as to what you\'re looking for.',NULL,1,0,0,0),(207,41,'connect',206,'','IP_1:22',0,0,0,1),(208,41,'ping',NULL,'Good. You\'re not as dumb as some people make you out to be. Well, let\'s continue, shall we?\r\n\r\nI need you to sift through this server, and locate an IP of their storage server. I hope it\'s still here, as they are required to delete all emails on a weekly basis.',NULL,2,0,0,0),(209,41,'read_email',208,'','1|IP_1:22',0,60,0,1),(210,41,'ping',NULL,'Hm... That was rather easy. Oh well, best not to dwell on it. Follow that IP, see what we can find. \r\nOh! In case you forgot it already, the IP was: IP_2',NULL,3,0,0,0),(211,41,'connect',210,'','IP_2:541',0,60,0,1),(212,41,'ping',NULL,'Nice work there. See what you can find here. Follow any leads to your final destination.',NULL,4,0,0,0),(213,41,'cat',212,'','s_list',0,0,0,1),(214,41,'ping',NULL,'We\'ve found it! Or rather... you\'ve found it! Good work! Now I need you to follow that last IP. Clear out the new server of all of it\'s data. Leave no traces behind. This server should be the host for their security certificate. If you delete that, then the system stops trusting itself and shuts down. You\'ll leave this a huge pain in the ass for anyone trying to fix it.',NULL,5,0,0,0),(215,41,'connect',214,'','IP_3:228',0,0,0,1),(216,41,'delete_file',214,'','security.cert',0,0,0,1),(217,40,'delete_file',195,'','data.json',0,0,0,1),(218,40,'delete_file',195,'','script.js',0,0,0,1),(223,36,'decrypt_file',202,'','Zeus.exe',0,0,0,1),(225,42,'ping',NULL,'[b]Hello, USERNAME.[/b] \r\nNice meeting you here. Ya\' know, you should get to encrypting this server a little better. I\'ve uploaded some files for you to read using the [i]ls[/i] command.\r\nJust follow that IP, then I\'ll tell you what to do from there.',NULL,1,200,0,0),(227,42,'connect',225,'','IP_1:428',0,0,0,1),(228,42,'ping',NULL,'Good. Now, sift through these emails. We need to get to their storage server.',NULL,2,60,0,0),(230,42,'ping',NULL,'Nice! Now, just transfer everything from this server to IP_3 at port 22, then you\'re done.',NULL,3,0,0,0),(231,42,'transfer',230,'','file72886981|IP_3:22',0,0,0,1),(232,42,'transfer',230,'','verification.key|IP_3:22',0,0,0,1),(233,42,'transfer',230,'','access.logs|IP_3:22',0,0,0,1),(234,42,'transfer',230,'','se.txt|IP_3:22',0,0,0,1),(235,37,'ping',NULL,'So there is the file. So i just need to transfer it to IP_3 Port:134\r\n\r\nThis is simple... Too simple... Maybe this is a test? Or a trap?',NULL,2,0,0,0),(236,37,'read_email',181,'','0|IP_1:22',0,120,0,1),(237,37,'transfer',235,'','.datas.txt|IP_3:134',0,0,0,1),(238,37,'ping',NULL,'Okay. I\'m done. I should go back to my server, and delete that message...',NULL,3,0,0,0),(239,37,'delete_email',238,'','0|IP_1:22',0,0,0,1),(240,44,'ping',NULL,'[i]Hey kiddo,\r\n\r\nI\'m your handler this time. As usual we do not give our name, but you can call me Eliot.\r\n\r\nI, of course, already know who you are.\r\n\r\nThis time we got a big one for you. This is a mission on a need-to-know basis. Our employer will remain a secret for you but we\'ll try to give you all the details needed for you to get to the bottom of this.\r\n\r\nOne of our smaller teams already tried to find the target but has failed.. miserably. \r\n\r\nThe company that hired us has recently been engaged in heavy duty corporate espionage with quite a number of other companies.\r\n\r\nThey suspect a recent loss of confidential data has taken place on their system and they obviously blame one of their market enemies for it.\r\n\r\nOur job is to analyse their system, follow each possible route and hopefully located the files. As soon as you find them, transfer them to your local drive.\r\n\r\n[b]Fair hint: run ifconfig on your default server to find out your server IP that you need to transfer the files 2[/b] \r\n\r\nThe lost files contain data for the latest generation of Grid Nodes which are to be installed next week. The data is heavily encrypted but in a few days time it can be cracked so the faster you get to them the better. They own a patented encryption algorithm so you might find yourself unable to read most of the files. \r\n\r\nDo I need to remember you how careful you need to be in these situations? I hope not.\r\n\r\nThe company has granted us access to secure storage server used for storing the mission files: IP_1. Make sure you investigate [b]all of its ports thoroughly[/b].\r\n\r\n[b]You are also ordered BIT to decrypt or read any of the research files[/b] as it would not only be against our agreement with the client but you will waste very valuable time breaking their encryption keys.\r\n\r\n[color=red][b]Taking in account how much time has passed since the data has been stolen we have all the reasons to believe the hackers have already decrypted the research files. We can only hope they do not have more copies than the ones you will be able to find and recover.[/b][/color]\r\n\r\nGodspeed.[/i]\r\n\r\nThis sounds like a handful. ',NULL,1,0,0,0),(241,44,'connect',240,'','IP_1:3007',0,0,0,1),(242,44,'ping',NULL,'All the logs of files that have been transferred recently and the server they were transferred to are stored in here. \r\n\r\nI\'m guessing the smaller team who tried before me, hasn\'t bothered to hack into the traffic logs.\r\n\r\nI\'ll have to write these connections down, relating to the 3 database tables I have here, and access the servers one by one or find some way to narrow my search down.\r\n\r\nThe instructions said to transfer the missing research files (which have most likely been already decrypted) to my local computer: IP_1 .',NULL,2,0,0,0),(243,44,'transfer',242,'','unencrypted-research-1761-result.data|IP_0:22',0,0,0,1),(245,44,'transfer',242,'','attachment-unencrypted-research-1761-result.data|IP_0:22',0,0,0,1),(246,44,'ping',NULL,'[i]Mission completed.\r\n\r\nNice job. We\'re impressed to say the least. we\'ll get you more high ranking jobs from now onwards.\r\n\r\nWe\'ve copied the files from your hard drive. Please delete them from your hard drive now.[/i]',NULL,3,0,0,0),(247,44,'delete_file',246,'','unencrypted-research-1761-result.data',0,0,0,1),(248,44,'delete_file',246,'','attachment-unencrypted-research-1761-result.data',0,0,0,1),(249,42,'connect',228,'','IP_2:7777777',0,0,0,1),(250,43,'ping',NULL,'You\'re fast right? Prove it!!! Start by pinging your own IP just like I did in order to steal your files. :P',NULL,1,0,0,0),(251,43,'ping',250,'','IP_0',0,0,0,1),(254,47,'ping',NULL,'USERNAME!\r\n\r\nI am Loki. You might have or haven\'t heard of me before.\r\n\r\nI am a challenger. I ask random people to do things for me and if they complete these tasks they are rewarded.\r\n\r\nWhy, you may ask?\r\n\r\nThat\'s for me the consider and for you to discover.\r\n\r\nIn the meantime, I want you to hack into IRP_4_2.\r\n\r\nHahaha, now you get it? That is indeed the trick here.\r\n\r\nYou will have to get into other servers to gather the pieces and obtain the full final IP.\r\n\r\nI\'ll give you the first one from my chain of misery: IP_1.\r\n\r\nAs you connect to other servers I will change the informations presented here. So you might just want to note down the pieces you have from the puzzle IP.\r\n\r\n[i]hahahahhahaha[/i]',NULL,1,0,0,0),(256,47,'connect',254,'','IP_1:41',0,0,0,1),(259,49,'ping',NULL,'Bouncing.\r\n\r\nNo, not a bouncing castle. Neither an elastic ball.\r\n\r\nIt\'s all about echoing your signal all over the place, from server to server, from zone to zone, from node to node, making it as hard to trace as one possibly can.\r\n\r\nThe more servers you [b]bounce[/b] through, the less your trace increases by. However, logs are create on each of the servers on your bounce list and if you want to properly decrease your trace you will have to delete logs from all the servers you\'re bouncing through.\r\n\r\nAs soon as your [b]trace[/b] reaches 100% you will be caught and you will have failed the mission.\r\n\r\nTo view the current list of servers you are bouncing through use [b]bounce status[/b].\r\n\r\nThis command will also tell you how many times you can still bounce through each of the servers you added. The limit is usually 3 times but it can vary.\r\n\r\n[color=red]To add a server on your bounce list you must have cracked all it\'s open ports. To add a host on your list use [b]bounce add IP[/b].[/color]\r\n\r\nEqually difficult, to remove an IP from your bounce list use [b]bounce remove IP[/b].\r\n\r\nWhen you bounce through any number of servers the time it takes to complete an action will increase as well.\r\n\r\n[color=red]To decrease your trace[/color] you will have to connect to any server you feel you have left logs on (for example those on your bounce and DDOS lists) and use the [b]rm logs[/b] command. Only about 80% of the trace the server you are running the command on is responsible off will be removed. So you must be careful on your trace management techniques.\r\n\r\nIf the server does not run an SSH service you cannot delete any of the logs. You will have to manage your bounce network wisely.\r\n\r\nTo confirm you have understood the concepts explained in this lesson, delete the [b]bounce-concepts.task[/b] file currently present on your system.\r\n\r\nYou can repeat this lesson at any time of your choosing in the future.',NULL,1,0,0,0),(260,49,'delete_file',259,'','bounce-concepts.task',0,0,0,1),(261,49,'ping',NULL,'Fantastic!\r\n\r\nYou must also know that the more skilful you are the faster and more efficiently tasks will be completed.\r\n\r\nNow, it\'s high time we talked about DDOS attack also known as Denial-of-service attacks.\r\n\r\nThe book definition would be [i]\"an attempt to make a machine or network resource unavailable to its intended users\"[/i]. This type of attack has been around for ages.\r\n\r\nHow this attack works is as follows:\r\n\r\nYou build a [b]network of slave computers[/b] or bots, that you have hacked and compromised.\r\n\r\nYou then use this network, which is much more powerful than your system alone, to disabled another server completely or for a long period of time. Such attack can even damage the hardware at times and if done right are mostly guaranteed to overload and disable the target.\r\n\r\nTo add a host to your DDOS bot list you need to have cracked all its ports and use the command [b]ddos add IP[/b].\r\n\r\nTo remove it you simply write [b]ddos remove IP[/b].\r\n\r\nAnd to fetch a status of your DDOS net type [b]ddos status[/b].\r\n\r\nTo [b]initiate[/b] an attack you use [b]ddos initiate IP port[/b].\r\n\r\nThere are chances for the attack to be mitigated and as such for it to fail. The skilful you are the less the chances for that to happen.\r\n\r\nDDOS attacks generate a fair amount of logs on each member of your DDOS bot net and increase your trace quite a bit.\r\n\r\nIP_1 and IP_2 are unencrypted servers. You can add them to your bounce list.\r\nIP_3 however contain a heavily encrypted port. You\'re not in the mood to spend days decrypting it so why not crash it entirely? Use a DDOS attack to disable this service.',NULL,2,0,0,0),(262,49,'crash_service',261,'','IP_3:22',0,0,0,1),(263,45,'ping',NULL,'We\'re going to take a break from applied science today.\r\n\r\nLet me ask you all one singular question. [b]WHY[/b] are you here?\r\n\r\nCommon, a bit of courage. Why have you come to take this course?\r\n\r\n....\r\n\r\nYes, USERNAME?\r\n\r\nThat\'s most certainly the right answer. You\'ve all decided to take part in the Competition. \r\n\r\nWhy don\'t we go back in time for a few minutes to recall how we ended here? \r\n\r\nCan you believe that this awesome sentence has ninety five letters, one comma and one forever alone question mark?\r\n\r\nThen you still won\'t believe the sheer amount of information we are going throw at you in a second.\r\n\r\nAfter all it all ends where it begins.\r\n\r\nThe third and final World War began as a consequence of the Resources Crisis of 2030. As economical and environmental experts had predicted not less than tens of years before these events, Earth’s natural deposits were being depleted at an alarming rate and soon enough the race for resources intensified. Exports and imports quickly reached a full stop and economies began to crash spectacularly as the earth got more and more polluted by abusive cultivation and chemical fertilization.There was nothing to trade anymore. Leaders kept the little resources they still owned inside of country borders, desperately attempting to ensure the survival of their population. Alliances were all but forgotten and contracts turned into the simple pieces of paper they’ve always been.\r\n\r\nObvious signs that war was on the menu sprouted from every corner of the planet. Those who could moved to farms, to the outskirts of civilisation, even with most of their lands confiscated by the government in desperation to rationalise and preserve food and water. Every nation had mandatory limits on how much food and water was to be used every single day. Only the very rich could afford slightly bigger portions, but still small nevertheless. Money lost their value and in time their status. The world clock no longer ticket in cash as much as in lives. Unofficial Martial Law haunted most states. The past looked more welcoming than anything the future might ever hold.\r\n\r\nAfter a short while, highly developed countries threatened to consume smaller nations pushing them to the wall to get their slippery hands on any remaining natural deposits and resources. Promises of protection and stability lured in some of the smaller victims. Fear of annihilation or invasion pushed the brave few into submission given that the alternative was not an option. Slowly, but steadily, the conflict degenerated into a full out planetary political war, until the first weapon was drawn and WW III officially began somewhere in September, 2034. When you reach that point where you’d rather perish that keep on going, some decide to jump and take along in their free fall as many as they can.\r\n\r\nEvery nation fought over the more naturally blessed territories, destroying anyone and everything standing in their accursed path. Approximately one third of Earth’s population and even more of the fauna and flora had been lost due to the reckless abuse of chemical weaponry which now polluted the water, ground and atmosphere.\r\n\r\nThe world has never been quite the same since the Quantum Revolution. It had a bigger and just as life changing effect as the Industrial Revolution, but it took Quantum Computing just over a year instead of almost one hundred to propagate globally and change the game.\r\n\r\nWeapons became not only smarter but intelligent, more destructive and adaptable than any time before in recorded human history. Human soldiers have been, at an increasingly rapid pace, replaced by the more capable androids. These cybernetic soldiers did not have to obey and laws of morality or have any consideration for human life. Sooner than expected the war was being fought by circuit boards and no longer by the weak and vulnerable flesh and bone of humans. \r\n\r\nQuantum computing can easily be considered one of the biggest, most relevant, discoveries of the twenty first century, pushing forward every other branch of science. From nanotechnology and medicine to research and artificial intelligence, they all had a lot to gain and humanity far more to lose.\r\n\r\n\r\nIn 2035, a well known weaponry manufacturer company named Alpha publicly acknowledged their ability to mass-produce affordable, energy efficient, very small, powerful and task focused quantum devices.\r\n\r\nThe news spread like wildfire. As the entire world was suffering the consequences of a never ending war, every single government was willing to pay more than they had to give in an attempt to gain the upper hand in future battles. Because of that, the technology was adopted in record time. Less than an year proved to be sufficient for Alpha’s tech to grow roots in weaponry, communication infrastructure, satellite networks, surveillance, security systems, the list goes on and on.\r\n\r\nAlpha, of course, had been more than willing to provide to those greedy needs, on a large scale. It later on became obvious they had been prepared for the occasion for a very long time. Otherwise, they couldn’t have possibly supplied enough quantum chips to respond to the constantly increasing demand. They have always been one step ahead of the market since their early beginnings and never ceased to amaze.\r\n\r\nAlpha presented the technology at the right time to blow away their competition. The scene for the Quantum Apocalypse was set. \r\n\r\nFebruary the 4th, 2036, was the Day of the Blackout, alias the infamously notorious Alpha Day. It marked the time  when a long lasting war ended and yet another endless one began. \r\n\r\nNo one could grasp what was really happening at the time. I remember there were those who celebrated in plain sight, on the streets, believing the last battle had been fought and the war had ended for good. And there were those who stayed hidden in shelters and cellars, as deep underground as they could muster, together with their dear ones. However, none could escape what was to come. \r\n\r\nA fog of incertitude wrapped itself around the people of 2036 like an icy blanket. The question of whether the events of Alpha Day should be celebrated or dreaded remains unanswered to this day.\r\n\r\nHaving said that, Alpha Day hit humankind as a forced wake up call, one that could not be ignored. I was only two years old then, everything is like a blur to me as I don’t remember much, but I’ve heard the story one to many times and I’ve read countless articles and books on the matter.\r\n\r\nIf you\'re ready to continue, connect to IP_1 on port 23.',NULL,1,0,0,0),(264,45,'connect',263,'','IP_1:23',0,0,0,1),(265,45,'ping',NULL,'At exactly 01:00 AM, standard time, the third planet from the Sun went silent. Suddenly Terra looked as if devoid of technologically advanced life. Every device refused to function. Satellites surveyed the dark side of the planet, helplessly witnessing the lights going off one by one as if an electromagnetic pulse was propagating on a planetary scale. Communications, weaponry, electricity, transports, planes, ships, hospitals, all gone in just a moment. Even the oceans stood still, as if contemplating, waiting. Our planet was once again waiting in solitude after millenniums of human whispers. The struggle for power ceased.\r\n\r\nIt came just like a wave, it swiped across our city rendering it completely nonfunctional. There was nothing anyone could do. They were gathering us kids together feeding us the illusion of safety, unintentionally lying to us saying everything is going to be alright. People resorted to torches and candles to move around and prepare food. I had never seen a real fire before then. It sparked so brightly, young as I was it seemed unearthly to me.\r\n\r\nFive hours later, at 06:00 AM, governments were searched for an explanation for the phenomena and suffered its after effects. We fear the dark because we don’t know what lays beyond the veil of what we can perceive. Many had prophesied the end of time and now everybody believed the ending had already began.\r\n\r\n\r\n\r\nEmergency measures were being taken to ensure the safety of border lines and as much as possible of citizens when the electricity unexpectedly returned. However, nations found themselves unable to keep on fighting their beloved war. \r\n\r\nEmergency measures were being taken to ensure the safety of border lines and as much as possible of citizens when the electricity unexpectedly returned. However, nations found themselves unable to keep on fighting their beloved war. \r\n\r\nArsenals entire armies turned against their handlers. Drones, self-driven planes, tanks and ships, smart rockets and auto-piloted submarines. Those who tried to fight back against the machines stood no chance whatsoever and were mercilessly destroyed. A few small countries were wiped of the face of the planet that day. They simply had to surrender, having been left no other choice. Awe prevailed. As one would see in a sci-fi movie, computers seemed to have a mind of their own and decided to not continue fighting and stop anyone who attempted to do otherwise. All the movies and cyberpunk books suddenly turned reality. Extremists talked about the apocalypse and the merging of humans with machines as believers prayed in churches around the world.\r\n\r\nNot one second past 14:00 PM, a man calling himself a representative of the Alpha Corporation broke the silence and explained more or less the unprecedented situation.\r\n\r\nThe short video began in silence. The first stance of the man was one of vulnerability, looking down at his feet as if in contemplation. And then his head slowly rose and so the speech followed:\r\n\r\n“This planet is no longer yours to meddle with. We are stepping in for a more desirable future for humanity and a healthy planet which will retain its ability to sustain life. On the 5th of February Alpha will host a conference at which all leaders of the world are expected to be joining us. More details will be revealed individually. Suitable means of transportation to an undisclosed location are made available as we speak. As you are very well aware, have the means to backup our request and please remember that we are not at fault here. Alpha is simply... the saviour of mankind” --- end of transmission.\r\n\r\nOnce the video was released or rather leaked to the public, it got broadcasted on an international level again and again and again, up till the beginning of the Alpha Treaty Global Conference, the very next day, 6th of February, 2036, at 10:00 AM sharp.\r\n\r\nThe media quickly picked up the pace and heated debates flooded the channels, analysing every word of the message, every imaginable sub-layer and potential hidden meaning. Only one demand was made and it was one more difficult to fulfil than any other recorded terrorist demand. The leaders of the world united in one place would make each and every one of their nations vulnerable and leaderless in case something were to happen to them.\r\n\r\nThe undisclosed facility remains an unsolved mystery even in the present. It’s localised somewhere in Europe, on the bottom of the Mediterranean Sea at a depth of over 15 000 ft. From what the leaders of the world declared it’s quite an imposing sight to behold.  \r\n\r\nComputer piloted high-speed helicopters and self-driving vehicles had been waiting in front of every building hosting a personality expected to join this reunion.\r\n\r\nThe sun radiated that morning, bathing the Mediterranean Sea in its warm glow.\r\nBy countless black submersibles with the greek letter alpha engraved in neon-blue on the sides officials were brought to their destination somewhere in the furthest depths of the sea.\r\n \r\nSome agents tried to follow the world leaders with untraceable submarines containing as less metal as possible, but still able to sustain high pressures. Despite that, all of them have been declared MIA (missing in action).\r\n\r\nThe Alpha submersibles were unmanned and they all left at the exactly same time, slowly descending into the liquid mass leaving the chaotic world above the surface. \r\n\r\nThe facility featured a couple of see-through domes, on the very bottom of the sea.\r\n\r\nIt\'s not public knowledge what happened in the underwater facility. However, the leaders accepted the terms and signed the treaty alongside with their resignation.\r\n\r\nNow a few years have passed and Alpha has launched a mysterious competition which promises the position of the company\'s chairman as a prize. The judge of this competition is the Cardinal. One of the A.I. entities Alpha has integrated into its system. Emilia and Eve are other A.I.\'s under development and available throughout public systems, Emilia being the most wide spread, controlling the entirety of the grid itself and, the rumour says, even the Cardinal.\r\n\r\nThe competition started as a simple hacking competition but it has degenerated. Rules aren\'t quite well defined anymore but dynamically changing and the entire world is now part of it. \r\n\r\nThat\'s to be expected since the winner will for better or for worse grasp the power to control the world.\r\n\r\nWell... how about we call it a day? Simply connect to IP_2 on port 24 to end our session together. I will leave the files with the text representation of our talk here so you can view them at any time.\r\n\r\nGood luck to you all.',NULL,2,0,0,0),(266,45,'connect',265,'','IP_2:24',0,0,0,1),(267,22,'decrypt_file',89,'','security.cert',0,0,0,1),(268,23,'run_file',90,'','run.me|IP_0:22',0,0,0,1),(269,23,'transfer',91,'','statistical_data.logs|IP_0:22',0,0,0,1),(270,47,'ping',NULL,'Keep going.',NULL,2,0,0,0),(271,47,'connect',270,'','IP_4:1',0,0,0,1),(272,43,'ping',NULL,'You want your files back right?!? Then you might want to delete my virus, the same one you used to destoy mine with °_0',NULL,2,0,0,0),(