ended itself from inside out, flesh regenerating at an incredible rate. Behind the two, an entire wall displayed a scan of the wounded, a neon-blue flow of nanites going through his vascular system, mending internal and external damage.\r\n\r\nTaking a deep breath, I walked on until I reached another dead end. A blast door with no apparent unlocking mechanism blocked my path. Approaching the entrance, I connected to wireless network of the facility which I hacked into while walking around.\r\n\r\nI have a couple of master security servers now and by the looks of the sign near this door, I need to find the slave server controlling the entrance to the M.D. - Access Level A and transfer the security certificate to it.\r\n\r\nIP_5\r\nIP_6\r\nIP_7\r\n\r\nHere we go again.',NULL,2,0,0,0),(349,32,'transfer',348,'','security.certificate|IP_8:22',0,0,0,1),(350,32,'ping',NULL,'That didn\'t do the trick what so ever. The door hasn\'t budged but I haven\'t triggered any alarm either.\r\n\r\nI\'m going to try one last thing. Crash the service completely and see what that does. My hope is that the security will be disabled while the master server chooses a new slave to control the door or attempts to reinitiate the one I crashed.\r\n\r\nA DDOS attack using some of the servers I already hacked should be just what I need.\r\n\r\nBye bye IP_8:22.',NULL,3,0,0,0),(351,32,'crash_service',350,'','IP_8:22',0,0,0,1),(352,32,'ping',NULL,'“Main deck. Access granted. Welcome back, system administrator”\r\n\r\nAt first, I thought someone had opened the door from the other side and I\'ll be busted any second. Luckily, no one was to be seen in the immense poorly lit spheric room. A pair of wide stairs offered access to a lower level of the sphere, exactly at it’s center. When I touched the first step with my left foot, Emilia spoke again.\r\n\r\n“Opening shield panels”\r\n\r\nBefore she finished, the sound of sliding metal filled the room and, soon enough, the bottom of the sphere opened like a blossoming flower, revealing a magnificent surreal view. The room lights dimmed considerably, the only remaining source being the Sun reflected from the mighty blue planet. I stood there, in awe, for what must’ve been hours of starring, speechlessly, at the breathtaking image. \r\n\r\nA girl I was not aware of at the time quietly observed my moves from the shadows, a few levels up, from a maintenance railing.\r\n\r\nOne step at a time I walked on the lowermost platform of the main deck. The see-through floor allowed an incredibly outstanding view of planet Earth. Iris’s current orbit allowed me to catch a glimpse not only of the planet’s dark side, but the side the Sun shone on at the same time.\r\n\r\nWithout thinking, I stretched my arm, aimlessly trying to touch the astral object. Unexpectedly, as I did so, weightless, paper thin, light blue, translucent holographic screens appeared in a circle around me. I have somehow managed to wake the sleeping systems. \r\n\r\nAs I was about pick up a file having my dad\'s name on it..\r\n\r\n“Warning: Unauthorised personnel on main deck. Warning!”\r\n\r\nThe projections dissipated while Emilia’s warning played and another door opened revealing the guide I have left behind. He didn’t seem happy.\r\n\r\n“What do you think you’re doing in here? Come with me, right now!”\r\n\r\nHe doesn’t seem to suspect I did anything important, he’s just angry he allowed himself to lose me from sight He’ll most likely not talk about this again since it would be to his disadvantage to report it.\r\n\r\nI take a look back at the now dissipated holographic screens. \r\n\r\nAs he drags me along I decide to delete the security certificate from my local storage. Just in case they now suspect anything and they try to hack into my device.',NULL,4,0,0,0),(353,32,'delete_file',352,'','security.certificate',0,0,0,1),(354,46,'ping',NULL,'',NULL,1,NULL,NULL,0),(355,46,'ping',354,'',NULL,0,NULL,NULL,0),(356,52,'ping',NULL,'A mysterious file has been found