nging down Alpha and freeing the world.\r\n\r\nWhen I think about it I am not as sure Alpha is the odd man out here. They have after all rebuilt the world better than any of the old government would have dared to hope to ever accomplish.\r\n\r\nI will, however, accept the missions even just for the thrill.\r\n\r\nThey want me to hack into these AI labs and fetch some of the different software components they are developing. Even in their current unstable form, when put together they should form a seed for an AI entity, give birth to a sentient being as powerful as the ones behind the Grid.\r\n\r\nThe consequences of our actions could be disastrous but who am I, a mere pawn, to doubt the plan.\r\n\r\nI\'ve received entry IP\'s for three labs. I will have to hack into each network, find the files and transfer them back to my server ( IP_0:22 ).\r\n\r\nThe main file is ai.seed. Once I get hold of it and try to execute it, I should be able to identify the other files I require.',NULL,1,0,0,0),(395,55,'connect',394,'','IP_2:22',0,0,0,1),(396,56,'ping',NULL,'Boredom. The most frightening enemy of all.\r\n\r\nA friend challenged me and a couple of other acquaintances the other day to get past his security system.\r\n\r\nWell, his exact phrasing was: \"My system is entirely noob-proof so you bunch won\'t gain access anytime soon\".\r\n\r\nHe even dared making it a bet: \"I\'m so sure that I\'ll reward anyone who can get in\".\r\n\r\nWhat are friend for after all?\r\n\r\nI\'ve already traced him through multiple proxies and found out one of his IP\'s. I\'m pretty sure it\'s his master server... should pretty much have the addresses of all other servers he uses on his network.\r\n\r\nKids job.\r\n\r\nIP_1',NULL,1,0,0,0),(397,56,'connect',396,'','IP_1:3306',0,0,0,1),(398,56,'ping',NULL,'This data looks strange. I\'m guessing it\'s some kind of encoding.\r\n\r\nI think I\'ve encountered it before. Isn\'t it base64? I\'m sure I can find some base64 decrypter by doing a quick search online and test my theory.\r\n\r\nIf I manage to decrypt the data I will have to hack into each of these slave servers and transfer the files I find to my main computer (IP_0).',NULL,2,0,0,0),(399,56,'transfer',398,'','to-do-list.txt:IP_0:22',0,0,0,1),(400,56,'transfer',398,'','mygame.gg:IP_0:22',0,0,0,1),(401,55,'ping',NULL,'I\'ve gathered the files and sent them over to Cobra.\r\n\r\nLooks like I\'ve got a new email on IP_5:3000.',NULL,3,0,0,0),(402,55,'read_email',401,'','0|IP_5:3000',0,0,0,1),(403,33,'ping',NULL,'It\'s never that easily over.\r\n\r\nYou have one more hill to cross.\r\n\r\nYou\'ve been decrypting, running, killing and understanding files and processes in this session.\r\n\r\nThere\'s one more thing I\'d like to teach your regarding these.\r\n\r\nSome files require you to specify parameters for execution. Parameters are values, usually strings or numbers, which need be typed after the name of a file when it\'s being ran. Without these valid values the file might not run the way it was intended.\r\n\r\nFor example:\r\nrun login.sh USERNAME 1234\r\n\r\nUSERNAME and 1234 are the two parameters the file above needed.\r\n\r\nTry it yourself on [b]final.sh[/b]. The parameters you need to give are [i]end[/i] and [i]lesson[/i] in this order. Be advised, final.sh will require task4.runme to be running.\r\n\r\n[b]See you on the other side.[/b]',NULL,3,0,0,0),(404,33,'run_file',403,'','final.sh|IP_0:22',0,0,0,1),(405,55,'ping',NULL,'WHAT THE FXXX?!!\r\n\r\nI don\'t need to take this shit. I\'m so going to delete this email to hell.',NULL,4,0,0,0),(406,55,'delete_email',405,'','0:IP_5:3000',0,0,0,1),(407,57,'ping',NULL,'[i]knock knock[/i]\r\n\r\nWhat the....\r\n\r\n[i]KNOCK KNOCK[/i]\r\n\r\nWho the hell knocks at 5 freaking AM...\r\n\r\n[i]The man outside breaks through the door and pushes you in the nearby wall, rendering your breathless[/i]\r\n\r\nWHO ARE YOU?\r\n\r\n[b]What do ya think ya\'re doin\'?[/b]\r\n\r\nWHAT are YOU doing in MY home?!\r\n\r\n[b