69,'run_file',603,'','Laserguidance.runx|IP_1:22',0,0,0,1),(605,70,'ping',NULL,'*ahahaha* So you\'re the new bunch, aren\'t you? *smirk*\r\n \r\nFresh meat has arrived people.\r\n\r\n[i]This guy is irritating me and he\'s barely started speaking. This is going to be such a long day, I can feel it.[/i]\r\n\r\nI don\'t know what made you want to be part of this mess. If it\'s your friends who signed you up, you might want to withdraw, NOW! Believe me, there will come a time when it\'s too late and you\'ll find yourself trapped and regretting not listening to your nasty instructor *cough* ME *cough* in the first lesson.\r\n\r\nThe world you\'re about to enter will swallow you completely and even when you feel like you\'re the own changing the world it\'s the world that changes you really.\r\n\r\n[i]He makes it sound so majestic. Luckily I know better.[/i]\r\n\r\nI\'m not sure how much history you know but we\'ll cover that later on as you will start your Computer Science crash course. For now, I will only share a few details about the tech competition, which you might already be aware of but we must follow the protocol..\r\n\r\nWell, first off we all know Alpha. Our corporation is now the main provider of technology and services for the entire planet and beyond it as well. \r\n\r\nOnly the brightest of the brightest are employed and the man at the top of the food chain is a mystery in itself. However, it\'s been publicly announced that he will soon want to retire (for no apparent official reason, rumours say he is sick but who are we to say for sure) and he\'s designed an entire system to select that one individual, male or female, of any zone, to take his place after his early demise. \r\n\r\nEmilia is the Artificial Intelligence entity controlling the Grid and more or less the entirety of Alpha\'s system and as such the world. The president of Alpha has hence designed the Cardinal, a complementary entity to Emilia. The Cardinal has the job of supervising the competition and enforcing its rules. \r\n\r\nNow what the competition is about. To put it in one word: hacking. The Cardinal Mainframe has access to all the systems Emilia has but is subordinated to her. However, he can observe and analyse everything everyone is doing and evaluates the progress of competitors based on their innovative hacking skills.\r\n\r\nYou might be aware that the competition has since degenerated to street fight and even ... murder at times. Some would do anything to be in control of Alpha and for good reason. Alpha has singlehandedly transformed the world in a hacker\'s playground. There are even parents who educate their children with the only purpose of participating and winning their competition when they grow up.\r\n\r\nThe reward for this game is whatever remains of the world in the end.\r\n\r\nThat\'s it for our short intro. I will leave you to our instructors now. Simply type [b]run final.sh[/b] in the input field / console when you\'re set to go.\r\n\r\n',NULL,1,0,0,0),(606,70,'run_file',605,'','final.sh|IP_0:22',0,0,0,1),(607,71,'ping',NULL,'Your task is trivial, hacker.\r\n\r\nWe\'ve given you three server IP\'s. On the first two servers you will find files containing the parameters required for you to run the file located on the third server.\r\n\r\nYou need only run the file on the third server on your main computer (so yeah you will need to transfer it to your main).\r\n\r\n',NULL,1,0,0,0),(608,20,'ping',72,'',NULL,0,NULL,NULL,0),(609,71,'run_file',607,'','hackdown.sh|IP_0:22',0,0,0,1),(610,72,'ping',NULL,'We\'ve provided you with the address of a server.\r\n\r\nHack into it, study what you find and get into the main database.\r\n\r\nYour mission is to read the contents from the single table available in that database and run the file we\'ve placed on your MAIN (hackdown.sh) using the parameters you find in that table.\r\n\r\nMake your way to the top, USERNAME!',NULL,1,0,0,0),(611,72,'run_file',610,'','hackdown.sh|IP_0:22',0,0,0,1),(612,20,'ping',NULL,'',NULL,12,NULL,NULL,1),(613,20,'ping',NULL,'',NULL,13,NULL,NULL,1),(614,74,'ping',NULL,'We are developing new security systems every day and we need you to help us out.\r\n\r\nYou\'ll have to hack into a few systems and decrypt and run a small number of files. This might take less or more time each time as we test different algorithms and encryption techniques.\r\n\r\nDon\'t forget to have fun!\r\n\r\nFor appetizers, hack into IP_1, explore and interact with what you find there.',NULL,1,0,0,1),(615,74,'run_file',614,'','protectedFile.readme|IP_1:120',0,0,0,1),(616,74,'ping',NULL,'Cool. You did it.\r\n\r\nOne last thing. Connect to IP_2:22.\r\n\r\nThere are two encrypted files there. Both contain one string required for a third file that you will find there to run.\r\n\r\nThese strings are parameters that you need to pass to the third file to execute it. E.g. [b]run something.file parameter1 parameter2 etc[/b].\r\n\r\nRun the third file to prove our encryptions have failed yet again.\r\n\r\nAnd I guess we\'ll be back to the drawing board.',NULL,2,0,0,1),(617,74,'run_file',616,'','run.sh|IP_2:22',0,0,0,1),(619,75,'ping',NULL,'Our competition keeps on updating their electrical cars every week or so. Always on a different day.\r\n\r\nThey launch new models as well. Once they get off the production line, the cars are programmed to automatically drive themselves to selling points around the world.\r\n\r\nWe need you to hack one of these cars by first hacking into the manufacturer\'s database and finding a list of car internal server IP\'s. As all of them are connected to the Grid, you\'ll be able to hack in as long as you have an IP. Most of the cars will still be on the production line with nothing installed on them, you\'ll need to identify one with an SSH service running.\r\n\r\nWe\'ve provided you with a script which needs to be ran on one of the cars. Once ran the script will send back data to us and your job will be complete. Remember to delete the file after running it.\r\n\r\nYou know a car is viable if it has the file [b]car.os[/b] present on its SSH server.\r\n\r\nThe current address of the manufacturer database is IP_1.',NULL,1,0,0,1),(620,75,'run_file',619,'','data.transmit|IP_4:435',0,0,0,1),(621,75,'delete_file',619,'','data.transmit',0,0,0,1),(622,76,'ping',NULL,'Since I\'ve joined this hacking competition I\'ve done things for others only... difficult jobs and mysterious emails, that\'s all it has been about.\r\n\r\nBut if you want to do something good you need to do it yourself and for yourself.\r\n\r\nPeople transfer money these days using the Grid alone. No more solid cash is being moved around for years now. So if I want to get some greenies I will have to find some work around.\r\n\r\nI\'ve devised a plan a while ago but never got around to putting it into practice.\r\n\r\nI\'m thinking I could edit the transaction logs of a grid bank node to trick the system into thinking a transaction of a certain amount of money has been made into my account.\r\n\r\nI\'ll also run a script on my computer which will basically block the grid bank node from contacting the outside world (which the node will log in its operating system).\r\n\r\nWhile that script is running I will hack into the power generator controls of that bank node\'s area and restart it.\r\n\r\nWhat this should do is allow me to report to Alpha that a transaction has not been completed to my account. They will check the logs on the bank node and see my fake transactions there and then they will notice the crash of the power generator and will assume the transaction was not completed due to the power outage. There are many of these these days because of the Beta and Omega movements. \r\n\r\nOnce they confirm the above, they will simply deliver the money to my account just to not be bothered.\r\n\r\nIf all goes well, I will finally have some money to live in comfort.\r\n\r\nI\'ve left some programs running in the background for the past week, scanning the Grid for bank nodes. The resulting file is on my local storage. Some of them might be out of date by now as the Grid constantly reconfigures itself.',NULL,1,0,0,1),(623,76,'connect',622,'','IP_3:352',0,0,0,1),(624,76,'ping',NULL,'I\'ve made a copy and edited the transaction logs file on my main computer.\r\n\r\nNow I\'ll have to delete transaction.logs from IP_3 and transfer the transaction.logs file from my server IP_0:22 to IP_3 to replace the deleted file.',NULL,2,0,0,1),(625,76,'transfer',624,'','transaction.logs|IP_3:352',0,0,0,1),(626,76,'delete_file',624,'','transaction.logs',0,0,0,1),(627,76,'ping',NULL,'Great. Everything is in place.\r\n\r\nNow, as planned, I must temporarily overload the bank node to make it and the Alpha investigators believe it was unable to deliver the transaction. And while my script does that I will have into electrical generator of the area and crash it to restart everything in a believable fashion.\r\n\r\nI\'ve create overload.vir on my main server. I\'ll have to run it offering the IP and port of the bank node as parameters.\r\n',NULL,3,0,0,1),(628,76,'run_file',627,'','overload.vir|IP_0:22',0,0,0,1),(629,76,'ping',NULL,'Seems to be working.\r\n\r\nWhat I need to do now is hack into IP_4 and transfer [b]crash.sh[/b] from my main computer to that server and run it.\r\n\r\nSince that\'s the power generator for the area the bank node (IP_3) is located, it will crash everything and restart as soon as it\'s back on. My overloading script will also stop executing as soon as I run crash.sh so all I\'ll have to do afterwards is to submit a report to Alpha to complain about my incomplete transaction  ^^.',NULL,4,0,0,1),(630,76,'run_file',629,'','crash.sh|IP_4:211',0,0,0,1),(631,77,'ping',NULL,'He\'s about to come out of the building. His day job ends soon so he\'ll head to his favourite restaurant for a bite before going home where he lives alone.\r\n\r\nI\'m going to hack into his car and bug it. I\'ll also check inside if he\'s left any devices like a Glass Tablet or maybe he even forgot his Glass Device (highly improbable as that\'s basically one\'s life) in.\r\n\r\nAnyhow, that\'s his car. No one\'s around. I\'ve placed a small device on the locking mechanism. It comes in contact with the car systems and allows me to interact with them wirelessly.\r\n\r\nPerfect, I have the IP: IP_1.\r\n\r\nFirst things first, I need to get through the security.',NULL,1,0,0,1),(632,77,'crack',631,'','IP_1:3756',0,0,0,1),(633,77,'ping',NULL,'That went well. A friend of mine has sent me the exploit for this model of car just in time. I\'ll just have to execute it using the IP and open port of the car as parameters.\r\n\r\nI\'ve downloaded the exploit he\'s sent me on my main server. Just need to run it, I guess.\r\n',NULL,2,0,0,1),(634,77,'run_file',633,'','carOS.exploit|*:*',0,0,0,1),(635,77,'ping',NULL,'He\'s still not here. That\'s good.\r\n\r\nAnd I\'m in the car, the door has opened as well.\r\n\r\nNothing of value around and there are absolutely no devices in the car that I could bug. I\'ll leave a little process which will send me GPS data so I can track him around.\r\n\r\nOh god, he\'s coming, I can see him through the glass walls of the building. Quickly, I need to kill the exploit and get out of here.',NULL,3,0,0,1),(636,77,'kill_file',635,'','carOS.exploit|*:*',0,0,0,1),(637,77,'ping',NULL,'That was close. A bit too close. I barely managed to run in time. He\'s driving away but my tracker seems to be working. \r\n\r\nI\'ll get my in my car and follow him.\r\n\r\nHe\'s indeed approaching the restaurant he visits almost every night. He stopped and I\'ve parked a few cars away.\r\n\r\nHe\'s in the restaurant now. I can pick up two wireless enabled devices that he owns. One is the Glass Device he has with him in the restaurant and the other is the Glass Table he must have brought from his office and left in the car. The two should be synced so most likely will contain same data.\r\n\r\nI don\'t have time and neither do I need to hack into both so I\'ll need to make a choice.\r\n\r\nI\'ve got scripts to discover their grid IP\'s, by hacking them wirelessly, on my main computer. I\'ll have to run one of them and go with that.',NULL,4,0,0,1),(638,77,'run_file',637,'','glassDevice.findip.sh|IP_0:22',1,0,0,1),(639,77,'run_file',637,'','glassTablet.findip.sh|IP_0:22',1,0,0,1),(646,77,'ping',NULL,'Oh wow, that\'s brilliant! His personal notes :3.\r\n\r\nLooks like I\'m in for a treat. \r\n\r\nThat foreign account data looks encrypted. Luckily these days you can use [url=http://bit.ly/KO4pQU]any search engine to find a base64 decoder[/url].\r\n\r\nI\'ve also picked up his laptop (IP_4:23). I\'m expecting some bankings apps will be installed onto it and I\'ll be able to use these accounts and passwords to run them.',NULL,6,0,0,1),(649,77,'ping',NULL,'After I ran it, a file was generated, containing the IP of the device. I\'ll poke my nose and see what I find.',NULL,5,0,0,1),(650,77,'connect',649,'','IP_2:3306',1,0,0,1),(651,77,'connect',649,'','IP_3:3306',1,0,0,1),(652,77,'connect',646,'','IP_4:23',0,0,0,1),(653,77,'ping',NULL,'I\'ll access all the banking apps he has. \r\n\r\nI only need to run them using the accounts and passwords I found and my viruses will take care of the rest rendering his vaults empty and mine\'s happier than ever.',NULL,7,0,0,1),(654,77,'run_file',653,'','bank.app|*:*',0,0,0,1),(655,77,'run_file',653,'','external-zone-bank.app|*:*',0,0,0,1),(656,78,'ping',NULL,'We\'ve received reports that some of our enemies have recently tries to access one or more of our servers.\r\n\r\nThe following servers have been compromised:\r\nIP_1\r\nIP_2\r\nIP_3\r\n\r\nConnect to and check of the logs of any of these servers and you should be able to identify the servers we we\'re hacked or attempted to be hacked from.\r\n\r\nYour task is to access the enemy servers, identify personal servers of their members, access one of those servers and delete all the files you