INSERT INTO `quests` VALUES (1,'The world within the Grid',0,300,0,1564,0,0,1,0,NULL,30,NULL,3,NULL,0,0,'Cardinal',0,NULL),(8,'Test New Objectives',1,12,0,38,1,0,1,2,NULL,30,0,3,NULL,0,0,'',0,NULL),(10,'Test if completed',3,1,1,38,1,0,1,2,NULL,30,0,3,NULL,0,0,'',0,NULL),(11,'asdf',1,1,0,38,0,0,1,2,NULL,30,0,3,NULL,0,0,'',0,NULL),(20,'Full Test Quest',2,200,1,1559,0,0,8,2,'Test\r\n[color=red]Test[/color]',100,100,3,0,0,0,'asf',0,'test2'),(22,'Decrypter 1',1,10,0,1564,1,0,4,0,'',30,0,3,0,0,1,'Cardinal',0,NULL),(23,'Decrypter 2',1,13,0,1564,1,0,4,0,'',30,0,3,0,0,1,'Cardinal',0,NULL),(25,'Crystal clear',1,15,0,1564,1,0,12,0,'A girl slowly approached me. She doesn’t look older than I am. I can’t feel the black floor keeping us from falling and when I glanced around I saw nothing, only darkness. ',30,0,5,0,0,0,'Cardinal',0,NULL),(29,'Ember Iris',2,30,0,1564,1,0,12,0,'At exactly 01:00 AM, standard time, the third planet from the Sun went silent....\r\n',150,150,5,0,25,1,'Cardinal',0,NULL),(32,'Into the Iris',4,40,0,1564,1,0,12,0,'The expected day is upon us. It\'s time to go where only few have been before. The Iris will open.\r\nBETA MISSION: Please report on forums any problems.',300,300,9,0,29,2,'Cardinal',0,NULL),(33,'Dealing with files && SSH Services',1,20,2,1564,1,0,15,0,'The Alpha Computer Science Crash Course presents you a lesson on managing files using the Cardinal console, an essential ability to any Computer Scientist and competitor in the challenge we know is in all of our hearts and minds.',50,40,3,0,70,10,'Cardinal',0,NULL),(34,'You got mail',1,15,2,1564,1,0,15,0,'Email is still largely used even in our days. It\'s important to know how the protocols that make it tick work. ',150,50,3,0,35,30,'Cardinal',0,NULL),(35,'SSH and cracking security',1,15,2,1564,1,0,15,0,'Hackers aren\'t devils. They aren\'t angels either. They are humans and they are the best of both sides. They are perhaps a necessary evil. They are the doctors of Computer Science. In order to fight them you need to join them so we\'ll take a sneak peek into at just how we can get through security systems.',100,70,3,0,33,20,'Cardinal',0,NULL),(36,'Cry Me A River',4,20,0,2195,1,0,16,0,'Last night our server got hacked... we want to stage a comeback! Have you got the right skills for the task?',200,40,3,40,0,0,'HaZaMaT',0,NULL),(37,'SO WE MEET AGAIN...',1,10,0,2417,0,0,17,0,'This is not what you think...',30,0,3,0,0,0,'hellblazer17',0,NULL),(38,'Mission 1',1,15,0,1564,1,0,6,0,'',30,0,3,0,0,0,'Cardinal',0,NULL),(39,'SELECT * FROM WORLD',2,17,2,1564,1,0,15,0,'We come across databases everywhere and anywhere. We just fail to notice the way computers need to think to do what they do. Today\'s course teaches us the very basic of manipulating a database server running on Cardinal OS.',200,111,5,0,34,40,'Cardinal',0,NULL),(40,'An unexpected contract',3,10,0,1564,1,0,18,0,'An unknown entity unexpectedly makes contact with you with a shady proposal.',100,83,3,0,0,0,'Cardinal',0,NULL),(41,'Sabotage',2,5,0,2226,1,0,19,0,'[b]To the public eye, corporations fight each other passive-aggressively, never outright throwing a hay-maker at their competitors.[/b] But that\'s not the case behind closed doors. Sometimes, companies want information on each other. Or in cases like this... Sometimes they just want their competitors to fall to their knees, crippled forever.',300,100,5,0,0,0,'Akafox',0,NULL),(42,'Espionage',1,3,0,2226,1,0,19,0,'Spy\'s have a mythical history to them. The only stories you ever hear of them are the myths and legends, and you never get to hear about them on the news. However, when you get offered a job that uses your skills to make you one of those legends, then how could you refuse?',300,150,5,0,41,1,'Akafox',0,NULL),(43,'Speedy Gonzalez',4,9,0,2195,1,0,16,0,'I hacked your PC and I\'m holding your files hostage. If you want to see them again you will have to be FAAAST!!',200,40,4,40,36,2,'HaZaMaT',0,NULL),(44,'Roads Untraveled',6,30,0,1564,1,0,18,0,'The Cobra\'s have yet another requests. About time.',400,300,5,0,40,0,'Cardinal',0,NULL),(45,'History lesson',2,22,2,1564,1,0,15,0,'The world within the grid. Hacking is not job, it\'s not a goal, it\'s not power or weakness. It\'s destiny.',300,250,5,0,39,50,'Cardinal',0,NULL),(47,'Vulnerability 1',1,10,0,1564,1,0,4,0,'',30,40,3,0,0,2,'Cardinal',0,NULL),(49,'Let you in on a little secret',3,15,2,1564,1,0,15,2,'It\'s not all cotton n\' candy. This competition is merciless and you must ALWAYS cover your trace. Leaving a trail of crumbs behind might be the last thing you\'ll ever get to do.',250,200,5,0,45,60,'Cardinal',0,NULL),(51,'Test SQL',1,20,0,1564,0,0,8,0,'',30,0,3,0,0,0,'Cardinal',0,NULL),(52,'Finding the Source',3,20,0,2580,0,0,21,0,'A mysterious file has been found in your folders. Where has it came from? Who put it there? Time to find out, the only way you know how.',250,150,3,0,0,1,'PurpleMoob',0,NULL),(53,'A voice from the past',1,20,0,3329,0,0,22,0,'You wake up at 7:00 AM and log into your mail server.\r\n4 new mails: Spam, Spam, a mail from the bank and... I remember this email address!\r\nIt\'s a mail from Jack! My primary school best friend! I haven\'t  heard anything from him in ages!',50,500,3,0,0,0,'TheBonviOne',0,NULL),(54,'First Step',0,300,0,1565,0,0,11,0,NULL,30,NULL,3,NULL,0,0,'default',0,NULL),(55,'Unraveling',7,19,0,1564,1,0,18,0,'I\'ve always known that friends are only my drawbacks, enemies my incentives, power my goal. Now I have the means and soon I\'ll accomplish my mission. We face fear alone and fear has many friends.',100,100,5,0,44,0,'Cardinal',0,NULL),(56,'Vulnerability 2',1,10,0,1564,1,0,4,0,'',30,0,3,0,0,2,'Cardinal',0,NULL),(57,'Where does the truth lie?',1,7,0,1564,1,0,18,0,'“I hate mankind, for I think myself one of the best of them, and I know how bad I am.” \r\n- Joseph Baretti',50,50,3,0,55,0,'Cardinal',0,NULL),(58,'The Approach',1,15,0,3933,1,0,23,0,'The Legendary Group Paladium contacted me. They may well be the one of the if not the strongest group in cyber world. I wonder what they need of me... \r\n\r\n[Please note explicit instructions have been avoided here ON PURPOSE , so as to enhance game-play. You are encourage to explore each and every thing logically and methodically. Future missions may contain some objectives that rely on pure LUCK.]\r\n\r\nEnter at your own risk!',10,20,3,0,0,0,'mage61099',0,NULL),(59,'Setting up Camp',1,20,0,3933,1,0,23,0,'The Paladium have recruited me into thier ranks. They are presenting me with a new server and a special Program. This is probably gonna be fun.....\r\n\r\n\r\n\r\n[ Please note the following details while playing this and further Paladium missions. ALWAYS crack all important ports BEFORE entering a system. All Passwords for the files are availabe on the internet, please Google them to find the answers.READ ALL THE FILES YOU GET it may contain clues. YES EVEN EXECUTABLE FILES CAN BE READ. Please be case-sensitive and first try all cases before sending an error report. Always THOROUGHLY examine all ports.  Hints have been provided in them.Keep your trace low , Paladium wants utmost secrecy. Please note this common sense info, as long as someone has something you need dont harm them, as soon as you get it  destroy them.]\r\n\r\n[Future Paladium Missions will always begin with an email to your New server unless specified otherwise]',200,100,3,0,0,0,'mage61099',0,NULL),(60,'The Beginning',1,14,0,3933,1,0,23,0,'This is the message i recieved from Paladium.\r\n\r\nWe must learn from our past experiences, we are sending you an email containing our history. Further instructions are in the email\r\n\r\nRegards, \r\nPaladium',60,20,1,0,59,0,'mage61099',0,NULL),(61,'Stealth',7,60,0,3933,1,0,23,0,'The Paladium has given me my first real quest. Lets get a crack on then!',250,300,5,10,60,0,'mage61099',0,NULL),(62,'The Challenge',3,8,0,3933,1,0,25,0,'You have been invited to a Old School Hacker Show Off. But with a Twist. 2 people do this together, so lets get on with it then!\r\n\r\n\r\n< PLEASE DO THE STEPS IN ORDER...  In case of queries please post about it ;) >',60,20,3,10,0,0,'mage61099',1,NULL),(63,'The  N00bs and the Pr0s',1,3,2,3933,1,0,25,0,'Those cheating MORONS! After we ran their file, Then they just kicked us out! We were just entertainment to them! Oh they WILL PAY!',130,50,3,25,0,0,'mage61099',1,NULL),(65,'Pink Hat ?',7,30,0,4047,1,0,28,0,'An organization calling themselves \" Pink Hat \" are planning to do something terrible.\r\nYou\'re asked to find out what it is and stop them if you got what it takes!\r\nFast before the world comes to an end.',150,126,6,50,43,0,'Gothic',1,NULL),(68,'Preparing for the battle - NOT FINISHED',7,5,0,4047,0,0,28,0,'The group we got rid of was just a bunch of kiddies,\r\nin order to face the people standing behind them we got to believe in our selves and the stories we heard from our grandparents before sleep.',0,0,0,0,65,1,'Gothic',1,NULL),(69,'V.S.O',5,10,2,3933,1,0,25,0,'V.S.O ? what is that??  its ....... oh god wow this group seems dumb. Anyway , the paycheck looks good. ',300,100,5,40,63,0,'mage61099',1,NULL),(70,'Coincidence by design',1,20,2,1564,1,0,15,0,'Deciding to join THE competition is a very bold move. Everyone has been relentlessly talking about it all around you and it\'s finally time to find out yourself exactly what all this fuss is about. \r\n\r\nLet me tell you now: It\'s not going to be an easy journey. It will in fact be [b]the longest and most gratifying journey of your lifetime[/b].',30,30,0,0,0,0,'Cardinal',0,'f'),(71,'Hackdown 1',1,17,0,1564,1,0,29,0,'',30,0,3,0,0,0,'Cardinal',0,NULL),(72,'Hackdown 2 PHP',1,17,0,1564,1,0,29,0,'',30,0,3,0,0,0,'Cardinal',0,NULL),(73,'Hack-Down ',2,20,0,3933,0,0,29,0,'The Hack-down Competition is about to start.... We hope you are ready to face some serious hell \r\nRegards\r\nAlpha',300,150,8,10,71,0,'mage61099',0,'Make em crack ...\r\nGive unique ports Done\r\nINPUT data for the hidden ips DONE \r\nCreate puzzles for L1 and L2  DONE \r\nUpdate Zoho.com chem website .... doing  DONE\r\nIP6 fairytail REMEMBER! DONE\r\nChem puzzle sfor longer path.  DONE\r\n\r\nUse multiple objective variability ?  LATER UPDATE...\r\n\r\n\r\nSecret Side obj?  LATER UPDATE....\r\n'),(74,'Daily Sacrifices',3,20,1,1564,1,0,15,0,'Our Computer Science Research Department can use your help on a daily basis if you feel like practicing most commands and keep a healthy mind each day ^^.',50,50,2,0,0,0,'Cardinal',0,NULL),(75,'Highway',1,20,1,1564,1,0,19,0,'One day, one car, one way.',30,100,2,0,41,0,'Cardinal',0,NULL),(76,'Worms',1,20,1,1564,1,0,30,0,'I\'ve done enough for everybody else. I think this is the perfect moment I start doing things for myself.',250,250,5,0,0,0,'Cardinal',0,NULL),(77,'Survival of the fittest',1,30,0,1564,1,0,30,0,'I\'ve met this guy once a while ago in a computer shop. He\'s full of cash and doesn\'t seem to know much about hacking. He\'s just the kid with the money who throws it around buying everything and pretending he knows how to use whatever he acquires.\r\n\r\nI\'m sure he won\'t mind if we share his fortune, don\'t you agree?',400,300,5,0,76,0,'Cardinal',0,NULL),(78,'Hacking Points',1,20,0,1564,1,0,31,0,'',30,0,3,0,0,0,'Cardinal',0,NULL),(79,'Basic Hacking',1,20,0,3933,1,1,32,0,'The billboard caught my attention from the corner of my eye and I felt compelled to read the rolling text\r\n\r\n\"ARE YOU TIRED OF BEING THE n00b? DO YOU WANT TO HACK LIKE A PRO? DO YOU WANT TO KNOW THE TIPS, TRICKS AND TACTICS OF THE TRADE? IF SO, JOIN OUR BASIC HACKING COURSE NOW!\"\r\n\r\nWell, lately things HAVE been though. The couple of missions and jobs thrown my way have been a bit hard. Maybe this will help .....\r\n\r\n{ THESE TIPS ARE ONLY FROM A GAME AND PUZZLE SOLVING POINT OF VIEW. THEY ARE USED TO INCREASE YOUR ABILITY TO SOLVE PUZZLES AND ENJOYMENT. THEY HOWEVER DO NOT REPRESENT ANY HARD OR FAST RULES TO DO ANY MISSION. }',50,30,3,0,0,0,'mage61099',0,NULL),(80,'Crashing Castles',1,1,0,3933,0,0,32,0,'Good job,  getting till here. Today\'s task is learninf how to crash a server around your target\'s pointy ears.',30,0,3,0,0,0,'mage61099',0,NULL),(81,'A simple message',10,10,0,4170,0,0,33,0,'The natural tendency of humans is to march towards safety. For example, we listen to our parents most of the times, and when we don’t, we feel bad for it.\r\n\r\nThe natural state of humans is peacefulness. For example, we won’t go out of our way to make random people miserable if we can help it. \r\n\r\nHumans, are peaceful creatures… unless they can attain power.\r\n\r\nWe will walk the unwalked path if it’s for our gain and we will destroy others for even a gram of real power.\r\n\r\nHumans are frail beings… at least, most of them.\r\n\r\nWhat about you?',1000,500,0,0,0,0,'Kitsune',0,NULL);
